        {
          "author_name": "Amal Abdul-Hafez",
          "author_url": "https://www.google.com/maps/contrib/112762942659260142286/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-tjvaz1Oeq7k/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjU36wFXvaW4V4Zi_GvPFjbFws76ew/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "It is very clean and efficient with great price. Location is very close to attractions and shopping places. Very close to cable cars. Good security. Great for bussiness trips or family vacations.",
          "time": 1515290567
        },
        {
          "author_name": "Enes Arslan",
          "author_url": "https://www.google.com/maps/contrib/111323319988252836521/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-anY4fnd31bA/AAAAAAAAAAI/AAAAAAAAAJ8/Im8Ffu1JBLw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 1,
          "relative_time_description": "2 months ago",
          "text": "The location is nice if you like a mix of drunk, loud and homeless people. Pony up another $60 for valet parking and a $30 resort fee. The room is so small I can almost stretch to touch the other wall. The toilet is the perfect size for a toddler. The bathroom door sticks like hell and the knob just came off. Also, my sheet was ripped. To top it off, my mom just gashed her leg on the bed because the damn room is so tight and the bed sticks out to much... NEVER AGAIN!!!",
          "time": 1513691621
        },
        {
          "author_name": "Aimee Jackson",
          "author_url": "https://www.google.com/maps/contrib/116059106766258191963/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-k38i4ehHDQI/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjX3OfiBQQluknLliLOHdJwtIk9sLA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 3,
          "relative_time_description": "in the last week",
          "text": "Very nice staff. The hotel was clean but very small. Great location though.",
          "time": 1518810752
        },
        {
          "author_name": "Austin Kelso",
          "author_url": "https://www.google.com/maps/contrib/107014335761139870855/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-QtUI7lVm83M/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjWeZdz2MbH1MFWYjC_0ouL3gsFZNQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "It was in the perfect location! In between Union Square and Market street. A smaller hotel but a very personal experience. The staff there are amazing as well.",
          "time": 1514433949
        },
        {
          "author_name": "Rebecca Dewey",
          "author_url": "https://www.google.com/maps/contrib/108882564715742101852/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-lxirWXbPN14/AAAAAAAAAAI/AAAAAAAAH_Q/235a9xstf2o/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 3,
          "relative_time_description": "in the last week",
          "text": "The electrics in the room are really flaky (some sockets don't work, some intermittently). Cleaning staff are rude and pushy. Otherwise fine. Good location.",
          "time": 1519143242
        }
