      "reference": "CmRSAAAASfOoClPI7hKQllWE7ShD40QfiKzdWVBdS_HSn9Tebcdggr5-Al6U9aSQKQCC0Xu4GHTkUZjcApIb8nhXD4wJbda0nK7szj1HUXnQhBio1bRXxpW8QnK7f9B2-Ptsz968EhBKjD92xJZ03LehE1_wuXxWGhRZjSl-gwFtVtBnX2LCSLfZkUYBJA",
      "reviews": [
        {
          "author_name": "Mia Yamauchi",
          "author_url": "https://www.google.com/maps/contrib/100373269539123503599/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-JJuWc_Ror1Q/AAAAAAAAAAI/AAAAAAAACQI/S_zLSxwOlg0/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 weeks ago",
          "text": "The black rice and tofu \"share\" dish is actually a good dinner-size portion for one person and absolutely delicious. I think it's gluten free and vegan, too! Decent scotch options at the bar. The design of the space is a nice mix between warm and  modern / interesting. Servers and bar staff seem genuinely friendly and helpful. Overall a good experience and I want to go back.",
          "time": 1517462159
        },
        {
          "author_name": "Brian Rutland",
          "author_url": "https://www.google.com/maps/contrib/111730267238604016258/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-z2kzViV3c08/AAAAAAAAAAI/AAAAAAAABXY/-IAA6OL8_HQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "Local is a nice, local (South Beach district) restaurant offering salads, pizze, and large plates, with a good wine and spirits selection. Relatively inexpensive for the area, too. The food is always pretty good. The service is good too, but it can be a little slow if the restaurant has a larger party. On my list visit we went a little long between courses, but the staff were proactive in addressing the delay and comped an appetizer, and when it turned out the kitchen was out of something er ordered, they took it off the check and improvised a replacement on the house. The hostess also saw our table wabble a bit, and she had someone come over to address it without our having to ask for it.\n\nAll in all, I'd recommend this restaurant to anyone looking for good, uncomplicated food with even better service.",
          "time": 1515263245
        },
        {
          "author_name": "Helen Chen Abrams",
          "author_url": "https://www.google.com/maps/contrib/114906606123658225795/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-74islwRy1sU/AAAAAAAAAAI/AAAAAAAAAEE/Sqyn4Cae3l4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "Tasty food and nice chill environment. They have some fancy cocktails in addition to wine. Parking at night isn't too hard since this is more of an office neighborhood.",
          "time": 1513665181
        },
        {
          "author_name": "Chelsea Goodson",
          "author_url": "https://www.google.com/maps/contrib/116550202924916913393/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-WyNV-H3ZSkM/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXV8SpavCeesbHHwkLjC_OL4M_YOA/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "5 months ago",
          "text": "Great brunch experience with unique food options. I had the slow scramble and my boyfriend had the fried chicken jalapeño sandwich and both were great! Waitstaff was pleasant, prompt, and gave great suggestions. We highly recommend this place!",
          "time": 1504467862
        },
        {
          "author_name": "Brieann DeOrnellas",
          "author_url": "https://www.google.com/maps/contrib/110294069301470339478/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-GfLlnQ_j9M4/AAAAAAAAAAI/AAAAAAAAArk/fqyovv9lfVQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "2 months ago",
          "text": "higher end cuisine, small plates, and pizzas. Nice wine selection, and great ambiance.",
          "time": 1512621859
        }
      ],
