      "reviews": [
        {
          "author_name": "Corey Strock",
          "author_url": "https://www.google.com/maps/contrib/109413032626718987280/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-L_n0SbAeJmg/AAAAAAAAAAI/AAAAAAAA-nE/PdUJ7b5LPco/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "Tons of beer options!  They had a bunch of their own stuff and like 10 or so guest taps too.  They also had nearly everything bottled, or you could always get a growler too.  I ended up trying 8 or so of their beers, and the standouts for me were the Fresh Roast Brown, and the Chocolate Stout.  The other beers were also good though.  I didn't try any food, but what I saw looked good.  The bartender was great though.  He was a man who liked beer and had no problem giving you his real opinion on the beer options.  He talked us off a couple of beers and in to a few others.  And the recommendations from him that we tried definitely worked out in our favor.",
          "time": 1518120473
        },
        {
          "author_name": "Matthew Kohen",
          "author_url": "https://www.google.com/maps/contrib/113942651400280899097/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-KDsdk7kUgM0/AAAAAAAAAAI/AAAAAAAAAgU/E4sJyD_YaDQ/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Went out with some friends. We couldn't get into some clubs. Frustrating night, getting late. drove by this place and stopped by. This place change the energy of the party. Great beers, great service, good company. We ended up drunk and laughing about the unfortunate events. Thank you Rogue for saving the night.",
          "time": 1516076109
        },
        {
          "author_name": "Alicia Lew",
          "author_url": "https://www.google.com/maps/contrib/102458378517872205138/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-h6MdVYNRL_o/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjUS4heznAXgZEZwgnSrlf-d0TcZsg/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Had a great Tuesday afternoon at the bar, with my Canadian friend. We live here. We’ve only had the best service. Female bartender was kind to my dog and super attentive to us. I was so thrilled with her service. While there are other places on broadway this place is absolutely recommended for the pleasant, friendly and welcoming atmosphere. Foods great, beers great, cmon down!",
          "time": 1516149878
        },
        {
          "author_name": "Ric Pelkey",
          "author_url": "https://www.google.com/maps/contrib/102098678228658872650/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-gQobUZym4ss/AAAAAAAAAAI/AAAAAAAAEF4/ke8H28aUM_w/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 2,
          "relative_time_description": "a month ago",
          "text": "Visiting from Canada, and stopped in during a Tuesday afternoon. For the most part of the afternoon I was the only customer. \n\nI found the atmosphere snooty and unfriendly. Any and all conversation with female bartender had to be initiated by me. I got the impression staff did not want to engage. Two male staff wouldn't make eye contact, or at least nod or say hello. Totally ignored me like I didn't exist. Not expecting staff to do back flips and hand springs, sit down with me and talk, but at least acknowledge my presence with a hello or something. Female bartender did pay attention to my Emory glass and promptly refilled with my choice. It was just the atmosphere. I would never return. I don't like spending my money in any establishment that makes me feel like I'm not wanted. \n\nTwo stars only because she did pay attention to my empty beer glass. \n\nFor great service and prices visit the brew pubs off Broadway in Oakland like Woods, DivingDog, etc. Great service! That's the reason I left them big tips.",
          "time": 1516147111
        },
        {
          "author_name": "Jolien Dirix",
          "author_url": "https://www.google.com/maps/contrib/104469359237055026313/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-bT70gtV1Emk/AAAAAAAAAAI/AAAAAAAAP0w/L7d5G6sDXdA/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "Good selection of craft beers in a laid-back American setting. Nice bar to watch some sports and have a handcrafted beer.",
          "time": 1518600003
        }
      ],
