      "rating": 4,
      "reference": "CmRRAAAABkd23mRJm63jUNl6Bu3DI6Lzw-XhR9VfSysTVKYmlOqjBiTfHXh6C05rqSIXWWCjQErS9dYthWdBQvOSr-y8FdhWcrBCVSp85EC8oHyXxhVgcPvHkkOuVkB92IcGEdbNEhDmQ_mivNk8pKzo5IXIxVOQGhT71Z3IfPPDHn9eNXm_-FbxiGe5eg",
      "reviews": [
        {
          "author_name": "Soubhik Dawn",
          "author_url": "https://www.google.com/maps/contrib/116169182974525349442/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-pSo1F7ERQ4c/AAAAAAAAAAI/AAAAAAAAlqI/CeYRCA0UucA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 weeks ago",
          "text": "The warehouse turned bar is a chill place to hang out in the Mission, particularly if you're getting off from a climb at Mission Cliffs. There's plenty of space spread across two floors and an outdoor patio. I love how they've placed trees and plants throughout the area. They have a good beer collection. And their for options are quite good as well.",
          "time": 1517737666
        },
        {
          "author_name": "Raquel B",
          "author_url": "https://www.google.com/maps/contrib/105191897253249906351/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-K7tb75ZQx_Y/AAAAAAAAAAI/AAAAAAAAHD4/h7iWowyLOg0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "Large beer selection on tap. Bar food is top notch bar food (way above your standard bar menu) but don't expect to have many vegetarian/healthy options to pick from the the menu. Cool ambiance. Hall used to be used by the old railroads in San Francisco. Nice patio outside and welcomes dogs. Insulation is terrible here so it gets cold at night even if you're inside. Also, their door guys are sticklers for IDs so make sure you have one that is current and if you're from overseas bring your Passport. Those country cards won't cut it.",
          "time": 1518651650
        },
        {
          "author_name": "Leon Kitain",
          "author_url": "https://www.google.com/maps/contrib/116127409753694193420/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-nnORJll1j6c/AAAAAAAAAAI/AAAAAAAACVI/r4JiFXPEIDI/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 1,
          "relative_time_description": "2 months ago",
          "text": "The changing demographics of San Francisco have provided for some interesting changes in enforcement norms. With an ever decreasing amount of couples having children inside the city, there are fewer and fewer teenagers trying to sneak in on a sunny afternoon with their fake IDs trying to get a craft beer.\n\nBut what to do? With this traditional demographic of ne'er do wells no longer available, who should be kept out? Who should the friendly security guard at the front eye suspiciously, using the heuristics acquired through years of enforcement to identify as a suspicious character, unable to enter this exclusive establishment without showing her id? \n\nIf you guessed by 82 year old grandmother, well, then you would be exactly right. I mean, I get it, she's got amazing hair. Really, if it wasn't for her stoop, the headscarf common to the \"babuskas\" of the former Soviet Bloc and the way in which she sniffed disdainfully as she wove her way past the homeless encampment in front of the bar's door, well, you could have mistaken her for no more than 65. A perfect target to not let in because of her lack of ID. \n\nTotally reasonable. But then methinks so is my 1 star review.",
          "time": 1512947953
        },
        {
          "author_name": "Mathias J. Klenk",
          "author_url": "https://www.google.com/maps/contrib/116654587011590396852/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-_HNkxdvlQ54/AAAAAAAAAAI/AAAAAAAADsU/ohMhEf0gc5A/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 1,
          "relative_time_description": "in the last week",
          "text": "Discriminate against foreigners. Won’t let you in if you don’t have an American ID or bring your passport. As a late 20s person who can prove his age one a driving license + national ID this is absurd. Seriously, who brings his passport with if you are going out for drinks?! That’s the most valuable document you have as an international. Won’t go here again.",
          "time": 1518668345
        },
        {
          "author_name": "Richard Syracuse",
          "author_url": "https://www.google.com/maps/contrib/111342876107506383529/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-CalOBqRo_II/AAAAAAAAAAI/AAAAAAAA6kY/vCE7oCDYm-I/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Not the most appealing place on the outside, but the inside is awesome and the staff is very friendly! Beer was great. Lots of styles and varieties. The food was rather good as well! I would totally go back!",
          "time": 1514570838
        }
      ],
