      "reviews": [
        {
          "author_name": "John Curley",
          "author_url": "https://www.google.com/maps/contrib/118044223808251604619/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-Jd3024t0Jmw/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVLPYyQIXNbbxmGv8xS1WauZ2ChSw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Our dinner was cooked perfectly and the service was excellent. We told them that we like to eat slowly and have some time between the courses. Of course, we only do this when the restaurant is not (!) jammed. They asked us when they should fire each course and that worked perfectly.",
          "time": 1515583775
        },
        {
          "author_name": "Kathy Hal",
          "author_url": "https://www.google.com/maps/contrib/117004761619987086516/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-KnBbbjPIb4M/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjU9m1al6qsOgrGWIWXzgZmnzz2f4g/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Will was our server and made our dining experience a pleasure. He is attentive, professional, kind, and has a lovely sense of humor. The food was delicious, and we look forward to dining at the Daily Grill in the near future. So nice to be treated with respect and as a valued customer!",
          "time": 1515707106
        },
        {
          "author_name": "Corinne Mitchell",
          "author_url": "https://www.google.com/maps/contrib/117060321783758517930/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-Y1KU2Bx1IT8/AAAAAAAAAAI/AAAAAAAAAiM/oBtj8Fxp7zI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 3,
          "relative_time_description": "a week ago",
          "text": "I enjoyed a seat by the window to people watch. The chicken piccata was good, not great. The grilled asparagus was tough. I ordered the chocolate bread pudding for dessert--very, very dry.",
          "time": 1518114937
        },
        {
          "author_name": "Angie Nett",
          "author_url": "https://www.google.com/maps/contrib/102823252853742321733/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-DcHuVhw5buw/AAAAAAAAAAI/AAAAAAAAA7E/BCRlTmSFHYo/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 2,
          "relative_time_description": "a month ago",
          "text": "Came in at 11:00 am, we sat at the bar thinking faster service. We were told the kitchen is switching from breakfast to lunch, had to wait 10 minutes before they could make food. 45 minutes later we received our lunch. There was a bartender switch after our order was placed, and it was a shame, the bartender that came in had no care for his customers, stress on his face with every request. A couple came in and waited 20 minutes to even get a greeting...poor service.",
          "time": 1514404682
        },
        {
          "author_name": "damon harris",
          "author_url": "https://www.google.com/maps/contrib/103431092532632022920/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-DSNdB4VBz-Y/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVRfZ1I6ekHrnQcmkym6oe18ppEAw/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 1,
          "relative_time_description": "a month ago",
          "text": "Dinner was great. Came back the next day for Wednesday pork chop special and told by new manager that had to wait an hour for menu to be available. At 3.30pm  At the same time she went ahead with her staff and seated a couple that came after us. When asked why they said oh sorry and too bad for you and everyone else that was waiting to spend money have to wait til 4.30. She said she was new and unable to handle the job.\nWow. Never will go to daily grill again. Spent 300 first night in town. I have never written a review but because it popped up on my phone this is the first and it had to be bad. Daily grill is scratched from my list.",
          "time": 1514419850
        }
      ],
