        {
          "author_name": "Giedrius Cikanavičius",
          "author_url": "https://www.google.com/maps/contrib/111210648595051507501/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-2vR0RsBzc7k/AAAAAAAAAAI/AAAAAAAATJg/MIG2BFKTEhc/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "7 months ago",
          "text": "Very good and reasonably priced food and excellent service. If you spend >~8.5$ for breakfast you get free coffee and fruits.",
          "time": 1499964881
        },
        {
          "author_name": "Mark McCauley",
          "author_url": "https://www.google.com/maps/contrib/107173605022757191310/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-nFrmCuxQBnI/AAAAAAAAAAI/AAAAAAAAL0c/J-hosynq2Iw/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 years ago",
          "text": "Best salad downtown, lots of awesome choices for toppings (my favorite is when they have caramelized pears).  I'm a pretty big guy and I can hardly finish the large salad. Great and friendly service. ",
          "time": 1455819521
        },
        {
          "author_name": "Jennifer D",
          "author_url": "https://www.google.com/maps/contrib/109990015325101967520/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-WG16rgAb5lg/AAAAAAAAAAI/AAAAAAAAFCk/plSmvbhp5yA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 4,
          "relative_time_description": "3 years ago",
          "text": "My favorite and freshest salad spot in the financial district. Beware, long lines if you go during the lunch rush. Actually the salad bar always has a line but it moves fast! These workers are awesome and so attentive. I always order my own salad with includes spinach/arugula salad mix, topped with marinated tofu, beets and red peppers or edamame. Sometimes I add in their lemon chicken with light balsamic dressing. Their spicy chicken is also to die for and I occasionally order their mac n cheese from the hot food area. Great lunch spot on the go with fresh, tasty ingredients! ",
          "time": 1413261305
        },
        {
          "author_name": "Elena Kalova",
          "author_url": "https://www.google.com/maps/contrib/102635577141556705753/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-yyTCEKIIjGQ/AAAAAAAAAAI/AAAAAAAAAiQ/evSZmfCCYH4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "2 years ago",
          "text": "Really good for a sandwich or daily specials. The lines at lunch tend to be long. Try to come at off peak times. The salads are awesome because you can basically make your own and they are huge. ",
          "time": 1447845892
        },
        {
          "author_name": "mike im",
          "author_url": "https://www.google.com/maps/contrib/103076165552823724526/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-u96NOWmvp_w/AAAAAAAAAAI/AAAAAAABTjc/pf6y-XJkQ2s/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg",
          "rating": 4,
          "relative_time_description": "2 years ago",
          "text": "If this place had seating it would be 5 stars. This place has such high quality food at great prices. ",
          "time": 1450070847
        }
