      "reviews": [
        {
          "author_name": "Kevin Jaskela",
          "author_url": "https://www.google.com/maps/contrib/116018211746666534134/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-lUvwpMs7LIk/AAAAAAAAAAI/AAAAAAAAHUE/_fd_YUaEtBo/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "A San Francisco staple. The Zuni chicken alone, even with all of its 60min prep time, is worth the trip. Situated directly against Market street, you’ll find Zuni Cafe to be a breath of fresh air surrounded by an “up and coming” area. It’ll take several more years for the neighborhood to catch up but don’t fret, Zuni will be there leading the way. Request a window seat near the kitchen for the people watching, but their upstairs is equally as charming.",
          "time": 1518796465
        },
        {
          "author_name": "Sean McBride",
          "author_url": "https://www.google.com/maps/contrib/108854030482751403518/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-fQj_nfGc3v4/AAAAAAAAAAI/AAAAAAAAUbQ/y58QU0g_Nso/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "A San Francisco classic, but still oh so vital. Arrive early to start your meal with a creative cocktail from the copper bar. Make sure to order extra bread. If you haven't ordered the chicken before, OMG order the chicken! And make sure to save room for dessert. A classy, San Francisco joy of a dining experience. ❤️",
          "time": 1518334122
        },
        {
          "author_name": "Crystal H",
          "author_url": "https://www.google.com/maps/contrib/110647532877896368240/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-DfnspDRBQmk/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjW0ADFEdXT3FaO_yI7aHcJDB-Yw-w/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 1,
          "relative_time_description": "a month ago",
          "text": "Completely overrated and  over priced. It is a beautiful and quaint place . We were not too hungry and did not want to wait an hour to order the chicken. We ordered a pizza which was under cooked and soggy in the center. Surprisingly thin crust, but was so sad and soggy.   The Quang's lamb sausage was better but not worth $20.  We finished with dessert and a coffee that was just okay. I was expecting more flavor from a house made ice cream.  More like an ice milk, no buttery mouth feel. The \"compote\" reminded me of cranberry sauce from a can.  Our server only checked on us to see if we wanted dessert. Not once after the entrees . Our dishes had been cleared before he came back.  Perhaps we didn't order enough for him.. Save your $.",
          "time": 1514735262
        },
        {
          "author_name": "James Araujo",
          "author_url": "https://www.google.com/maps/contrib/103704678007795356443/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-SK5y9FYWJWk/AAAAAAAAAAI/AAAAAAAAAlY/WgMuu_3BAkU/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "1. Make a dinner reservation in advance. \n2. Order the chicken for two immediately (it takes about an hour to cook).\n3. Enjoy some small plates and drinks, but leave room for the chicken.\n4. If you've got room, order dessert.\n\nRomantic atmosphere, seems to attract semi-final clientele.",
          "time": 1512185936
        },
        {
          "author_name": "Rachel Way",
          "author_url": "https://www.google.com/maps/contrib/112173234852066577877/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-Z2C4CJHL2cE/AAAAAAAAAAI/AAAAAAAAAEg/4lVYkOt7mXU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 4,
          "relative_time_description": "2 months ago",
          "text": "We went for the burger since many rave it is one of the best in SF. It was delicious & perfectly medium rare as requested, but I don’t see myself going back anytime soon for a 23$ burger with so many other good value crave worthy choices around. Lovely atmosphere and friendly staff. Quick service around 1pm on a weekday.",
          "time": 1512707200
        }
      ],
