          "rating": 5,
          "relative_time_description": "3 months ago",
          "text": "We regularly eat lunch before the theater. Service is gracious, city street view always interesting. We get favorites like Cilantro Shrimp salad and excellent soup. Quality of the food is consistent, spices enjoyable, there is a full bar for enhancements.",
