          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "The food was pretty darn good and diverse British offerings, but the service was slow. We were there on a Friday afternoon for lunch. The brussel sprout crisps we're scrumptious and the black currant refresher was a nice non alcoholic delight. The space is beautiful and upscale.",
