          "rating": 4,
          "relative_time_description": "3 weeks ago",
          "text": "I highly recommend the scones (if you like sweets) and anything with bacon in it. The breakfast sandwich had a little too much bun for my taste but it was delicious and the egg was the perfect amount of runny. The staff was excellent and very attentive.",
