          "rating": 4,
          "relative_time_description": "a year ago",
          "text": "I want to give this place five stars because the food was unbelievably delicious. We went for brunch on a Saturday and service was super fast despite them only having one cook, and us having a large group. However, the place itself is a total dive. It's dark and dingy, they keep kegs in the bathroom, and there was a dog walking around the restaurant. I love dogs, but I thought that was a little strange...",
