      "reviews": [
        {
          "author_name": "Jeromy Carpenter",
          "author_url": "https://www.google.com/maps/contrib/108886290057491644227/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-xxj2GBSCs2c/AAAAAAAAAAI/AAAAAAAABPY/tDnK3ea24-8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 weeks ago",
          "text": "It's no wonder this restaurant is one of only four in San Francisco that received their first Michelin Star in 2017. Rich Table serves up an ever changing menu of gastronomical delights that will awaken your taste buds and your imagination. It is almost impossible to get a reservation at this restaurant right now, due to their increased attention from their new status as a Michelin Star restaurant, but if you are willing to go at any time, the food is definitely worth the wait. The Chef's Picks included several rounds of appetizers, an intermezzo, a main course and dessert. Each round was as different and delectable as the one before and everything on the menu a work of art. If you are looking to impress a date, or a boss, this is the place to take them!",
          "time": 1517933232
        },
        {
          "author_name": "James Seechurn",
          "author_url": "https://www.google.com/maps/contrib/103062496252109693532/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-MuDTElC860g/AAAAAAAAAAI/AAAAAAAAA-o/LV0DJw20fKA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 3,
          "relative_time_description": "3 months ago",
          "text": "My expectations were high for Rich Table. We chose the tasting menu and it started well with a selection of delicious and original flavors. However I don't feel the fried sole worked particularly well with, what was an excellent cut off fish, obscured by batter and tartar sauce. The pasta was a fairly standard mix of flavors and the desert was a dark chocolate and mint combination which reminded me of something you could buy in a supermarket. Waiting staff were fine but certainly below what I would expect to earn a star. All in all it was enjoyable but for the price I expected a bit more.",
          "time": 1511118883
        },
        {
          "author_name": "Andress Blackwell",
          "author_url": "https://www.google.com/maps/contrib/110928915985761637347/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-bqYw0XHliLI/AAAAAAAAAAI/AAAAAAAAEwk/hHiurD9NBgU/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 2,
          "relative_time_description": "3 weeks ago",
          "text": "Complex menu (which can be good but not in this case) and pretentious air... and staff felt unapproachable. Space was small and could have been a nice intimate experience.",
          "time": 1517080804
        },
        {
          "author_name": "Vasili Nikolaev",
          "author_url": "https://www.google.com/maps/contrib/114632257786798606985/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-cpGOUTragag/AAAAAAAAAAI/AAAAAAAAARY/fOwF891Gyu4/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "Can’t believe I’m only now discovering this place. From start to finish everything about this restaurant is amazing.  Ambiance is on point and the food is to die for.  The richness of flavor, every item was a 10.",
          "time": 1512099275
        },
        {
          "author_name": "Matt Madigan",
          "author_url": "https://www.google.com/maps/contrib/101258952661007154226/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-RIlEAyfkggM/AAAAAAAAAAI/AAAAAAAAAJI/_iQkGwvQ8HY/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "The chef's tasting menu was amazing. Great service and even better food.",
          "time": 1518140003
        }
      ],
