      "reviews": [
        {
          "author_name": "Sally Schoeffler",
          "author_url": "https://www.google.com/maps/contrib/103903380750913476841/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-i9Vk4wXYNmE/AAAAAAAAAAI/AAAAAAAAJ38/feg01bDXq3A/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Great food and very friendly service. The fried rice and green beans were delicious. They were great dealing with food allergies. Large area still feels intimate.",
          "time": 1516517102
        },
        {
          "author_name": "Nuria Spijker",
          "author_url": "https://www.google.com/maps/contrib/107771860806750148619/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-GcAoYaKPKeU/AAAAAAAAAAI/AAAAAAAACm8/UwwGGkpvYLY/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 months ago",
          "text": "Limited menu, but what they do have to offer is excellent. I had the prawn satay, which was wonderful and an interesting twist on traditional nutty satay. I had the silky chocolate cake for dessert which was sinfully delicious and worth a visit all on its own. The service was phenomenal from the moment I stepped in the door to the last bite of dessert. Nice ambience too, both for dining alone (as I was) as well as with a group.",
          "time": 1510975501
        },
        {
          "author_name": "Matt Hooper",
          "author_url": "https://www.google.com/maps/contrib/102487049337201841566/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-x0W12RjbYhA/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjWHeMQ0oMUVM_XJ1S2eO5AWlRowSQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "Went for happy hour.  Great service.  Comfortable hip ambience.  Menu selections very good.  Try the dollar oysters and chicken satay. Definitely going back.",
          "time": 1514267125
        },
        {
          "author_name": "Vaibhav Natu",
          "author_url": "https://www.google.com/maps/contrib/103228132666280959635/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-wuNFyo_thH0/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjUH7XAanysW3Oh6BpsLQSWmERbCjg/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Helpful service. Interesting twists on traditional Asian/Indian cuisine. Nice ambience. Five minutes walk from Union Square. Fair pricing.",
          "time": 1514650615
        },
        {
          "author_name": "Blake Burch",
          "author_url": "https://www.google.com/maps/contrib/112203652148754017853/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-5SeREHZR86U/AAAAAAAAAAI/AAAAAAAAYnc/NvuJxeq55Gs/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 4,
          "relative_time_description": "3 months ago",
          "text": "When I went to E&O, my group ordered multiple items off the menu, family style. After trying multiple things off the menu, I can confidently say that the corn fritters are the best thing about this place. I'm still craving them weeks later.\n\nEverything else on the menu was good as well, although all of the deserts (except the ginger spice cookies) were a miss for our group. That said, you won't be disappointed with your experience here.",
          "time": 1511248693
        }
      ],
