      "reviews": [
        {
          "author_name": "Suzanne Correa",
          "author_url": "https://www.google.com/maps/contrib/108031927598928515585/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-ritq48mGFdQ/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjUTUM2MpuHIz8vihacpglUEepzMtw/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 weeks ago",
          "text": "There is a reason that they have been open for so long.  There is a reason major Financial deals are negotiated over lunch at the bar. The food is perfect. The service is perfect. The drinks are frankly some of the best in the city. The atmosphere is perfect. This is a great place to celebrate any occasion.",
          "time": 1517509374
        },
        {
          "author_name": "Tani Dowell",
          "author_url": "https://www.google.com/maps/contrib/112904243349454591730/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-aqnt5_FT7Hs/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXBSeRfnx7Sy7qSHT1QG-HAL8f2Cg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Stumbled across this restaurant and so happy we did! Hands down our best meal while in San Francisco.  Exactly what I was hoping for as far experiencing the ambiance of San Francisco.  The food was AMAZING... this will be our go to next time we are in town!",
          "time": 1515483219
        },
        {
          "author_name": "A Bond",
          "author_url": "https://www.google.com/maps/contrib/101310391110553894106/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-FFkwMr3ZVRk/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXujBmUjbnoy0hDYE59GfL4BqCMhw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "Great spot.  Classic bar restaurant and the food is great. Probably not for everyone but definitely my kind of place.  Defines great food and bar haunt in old school style. Super pro staff here as well. Fish cooked on your choice of open flame is not to be beat. Its crowded and can be noisy but that's what I like.",
          "time": 1512358411
        },
        {
          "author_name": "K G",
          "author_url": "https://www.google.com/maps/contrib/108345978822287231752/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-Q_rO8k2OZso/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjWRp1jDhXdY4CNCQTpkK-M8KcOiog/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "Always need to plan a visit when in SF. Clam chowder and an Anchor Steam to warm you up from the Bay Chill. Excellent service, classic historic spot. Beautiful long bar makes it easy to pop-in without needing to wait for a formal table. Efficient service.",
          "time": 1512343519
        },
        {
          "author_name": "Jane Wang",
          "author_url": "https://www.google.com/maps/contrib/108366806147439084612/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-w3Io1juG_iY/AAAAAAAAAAI/AAAAAAAAAAo/9dkDTIMa4Tk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "The Taddich Grill is what you might imagine SF dining was like 50 years ago. They offer a variety of fishes prepared in a few different ways: grilled, saute, pan fried or deep fried. Every plate comes with cooked seasonal veg and rice or potatoes. The fish I've had here has been pretty fresh, though somewhat under seasoned. Oh but why do I keep coming back? The ambiance exudes an old world charm that is so refreshing in this hipster-run city!The clientele is a mix of regulars, tourists, and business people coming in for a drink. The wait staff (men in white coats who have likely been working here for 10+ years) is charming yet efficient. Nothing escapes their watchful eye. They seated us at the bar in the order that we came in without taking our names down! During my meal my cup never ran dry and every condiment was brought over without asking.  Tadich is a true SF gem for old timey favorites!",
          "time": 1516255743
        }
      ],
