      "reviews": [
        {
          "author_name": "Sergey Blashkov",
          "author_url": "https://www.google.com/maps/contrib/102466173091403682821/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-_KWxGrUM-3M/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVacFcr1TgW3We5BEzifk4zRpawnA/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "We enjoyed our visit here even though we had to wait about 30 minutes. The sky terrace has great view on San Francisco and the Union square in particular.\nIt is located on the 8th floor and you have two options: to sit on the street having spectacular view, or inside.\nBirds are a bit of a problem but it is okay overall.\nParking is not a problem if you agree to pay the price.\nThe food is good and portions are enormous so we always take half of the order in the boxes to go.",
          "time": 1517274014
        },
        {
          "author_name": "Glue Guy",
          "author_url": "https://www.google.com/maps/contrib/116268885455639659907/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-1hMGNYvVYkQ/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjWUpngokeP82BTjGtX3NA1htuFK2A/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "in the last week",
          "text": "Normally Great food, overcrowded at 3pm. Ate at the bar. The drinks looked great. \nHad a over cooked hamburger... I  know a hamburger at the Cheesecake factory?? What was I thinking? The offer was there to refuse and get something else... I guess I am not type to do that unless it is really bad.",
          "time": 1519090687
        },
        {
          "author_name": "Julia Trubchyk",
          "author_url": "https://www.google.com/maps/contrib/106265500250105768760/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-TQsArOXGEDA/AAAAAAAAAAI/AAAAAAAAAv8/-pVsdP3nYec/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Cheesecake Factory it's always good place to visit. Most of all I liked a view from outside patio, highly recommend to go there if weather is good. Menu is full of different foods, hard to make a choice:) hope one day they will provide menu with pictures. The only bad thing is a waiting line...",
          "time": 1516515852
        },
        {
          "author_name": "Logan Deane",
          "author_url": "https://www.google.com/maps/contrib/113999293884120876244/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-VbcfDS2xtfQ/AAAAAAAAAAI/AAAAAAAAAao/5GtJyG8OGQI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 4,
          "relative_time_description": "2 weeks ago",
          "text": "Dinner portions were very large and were fairly tasty. Menu has a very large selection, to the point where one doesn't feel like reading through everything. The cheesecake menu also has a lot of selection, but the cheesecake we had were pretty mediocre. It's still good, but not as rich or dense as one might like.",
          "time": 1517882263
        },
        {
          "author_name": "Ümit Öngün",
          "author_url": "https://www.google.com/maps/contrib/108309336616456804305/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-kgTC0QTWEoQ/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVBuqTF2WGgvkxSbnPqUYEuwA0jiw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 1,
          "relative_time_description": "a month ago",
          "text": "Terrible seating assistance. They gave you a device that shakes and after shake you know you will be seated. But even though our device shakes, they didn't seat us they say they call my name. I can't understand why they make that devices if they didn't use it. We waited obnoxiously because we are tourist and English is our second language. We are afraid to not catch the names. We waited almost half an hour like this and then ask they say we didn't forget you. But after another than minutes we left there because we lost out hope. Terrible attitude and business. Unbelievably bad workers.",
          "time": 1514855374
        }
      ],
