      "reviews": [
        {
          "author_name": "Raquel B",
          "author_url": "https://www.google.com/maps/contrib/105191897253249906351/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-K7tb75ZQx_Y/AAAAAAAAAAI/AAAAAAAAHD4/h7iWowyLOg0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "Shouldn't be telling you, but this place truly is a happy hour gem. Great prices on food and drinks. You can get away a drink, food, and tip for ~$12 if you need a quick fix. It's first come first server for the HH seating and is not ideal for big groups. It's really too intimate and you'll have a hard time finding enough seats for +4. Because their prices are so screaming good show up early (4:00 pm) or expect to wait.",
          "time": 1518651709
        },
        {
          "author_name": "Aleksandr T",
          "author_url": "https://www.google.com/maps/contrib/111156926075252286026/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-jaa2sx3dXns/AAAAAAAAAAI/AAAAAAAAAEw/2EO8ncyL_90/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "One of the best chips in town. Orange sauce is AMAZING. Everything is pretty much on point and good. \n\nDinner lines can be long, as much as an hour wait. Lunch is quicker. \n\nOutdoor seating along with indoor. Staff is friendly.",
          "time": 1518944390
        },
        {
          "author_name": "Chris Garnica",
          "author_url": "https://www.google.com/maps/contrib/108662683396079556797/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-atdSLmkDCo0/AAAAAAAAAAI/AAAAAAAAAD4/McR9fDt9E3w/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "Great Mexican food restaurant in the Financial District tucked away on Yerba Buena lane. Great  place for lunch but if it's a weekday and you're short on time then you'll want to get there by 1130 as that's when the line starts building up. They have the menu on the wall when you walk in, you order and pay upfront and then they'll bring it to you. So you can in and out of there pretty quickly if you want to. The guacamole is great but expensive and skimpy. I ordered a large and it wasn't even really enough to share with anyone. I've been told not to order the mole here as it isn't really to par however I ordered the barbacoa last time and it was excellent.",
          "time": 1515652715
        },
        {
          "author_name": "Carolyn Hanrahan",
          "author_url": "https://www.google.com/maps/contrib/115115638765360127010/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-6HCSUrQFyS4/AAAAAAAAAAI/AAAAAAAAZKU/nP7LPY21euE/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "Delicious food, great service. Seated right away outside. Chips and salsa we're so good! Tacos 🌮🌮 beans and rice we're fresh and filling.",
          "time": 1518946733
        },
        {
          "author_name": "Sarah Odeh",
          "author_url": "https://www.google.com/maps/contrib/108194256961356627769/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-thVKzE4RDCQ/AAAAAAAAAAI/AAAAAAABNaQ/nSgZ7qyOUyU/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "I love this place. I’ve been here probably 5 times and am always extremely happy with the food. The last time I went I had the “salad” with prawns and was super happy. It was light, balanced, and filling. The guacamole is tasty, he chips are crispy and well salted, and I love the salsa bar. They have such a great selection of salsa. The pico and the green sauce are my favorite",
          "time": 1514409544
        }
      ],
