          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "Yum! Stopped here for some drinks and apps before heading to the Symphony with my girls. We were running late (fancy clothes takes more time!) and the server at the bar was quick attentive and helpful with a speedy check. Cocktails were fabulous, apps we're creative twists on classics. Fried garbanzos didn't last a minute on the plate! Nom!",
