      "reviews": [
        {
          "author_name": "Nicholas Dal Porto",
          "author_url": "https://www.google.com/maps/contrib/113001231697323651188/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-ejoiYz8knhQ/AAAAAAAAAAI/AAAAAAAAAO0/-fHabMpE3vw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "This place is so cool. Food is overall fantastic, nice service. The building is awesome. Definitely an \"old-school\" city feel. They've even got probably hundreds of portraits of San Francisco Police captains, lieutenants, and inspectors up on the wall. Overall it's just a really unique restaurant. Highly recommend it.",
          "time": 1518161602
        },
        {
          "author_name": "martin stacey",
          "author_url": "https://www.google.com/maps/contrib/104464615819534739568/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-cnXa_O__L-U/AAAAAAAAAAI/AAAAAAAAG20/5l9eNqnHxfM/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 3,
          "relative_time_description": "3 weeks ago",
          "text": "I'm by no means a critic but here are my opinions. \n\nAmbience:\nSitting down the jazz was obnoxiously loud meaning the people sat across the walkway to me had to near-on scream at each other to be heard... meaning I had screaming couple vs overly loud jazz...  Not a good start.\nThis restaurant also isn't the kind of place you sit down and enjoy a slow meal (which is my preference), it comes across more rushed and a more in'n'out kind of joint which came through in the service. \n\nMeal:\nThe steak was OK... I've had amazing steak and I've had good steak,  this for me was just below the latter of the two with a lot of fat that could have been trimmed but wasn't. \n\nThe dessert was the star of the show. Which for me sets a great restaurant apart from an OK restaurant. A great restaurant will wow you throughout the meal; an OK restaurant will make sure you leave on a good note.",
          "time": 1517203688
        },
        {
          "author_name": "Aaron Bryson",
          "author_url": "https://www.google.com/maps/contrib/107688385324440994519/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-jG_EG-C2_Ac/AAAAAAAAAAI/AAAAAAAADEQ/4ndMb3sGpAY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "Excellent Filet Mignon and Heirloom Tomato Salad. The server​ was very polite, knowledgeable and fast. Very quick service from time of order for this type of restaurant. Really nice retro atmosphere. The Clam Chowder was among the best I have ever had.",
          "time": 1518748042
        },
        {
          "author_name": "Gary Elias",
          "author_url": "https://www.google.com/maps/contrib/101257511874372047644/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-ao1hu2VSsIY/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVKF2gJuH8k8cjpYzpgDcWZrLmTFQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "3 months ago",
          "text": "I'm from the Midwest. I know and well appreciate corn fed Midwestern steak. The problem is finding it because they ship most of good stuff out. John's Grill apparently is responsible for some of that shortage. My steak was excellent. Great taste, tender and cooked correctly. The service was good and fast. San Francisco isn't my favorite city but John's certainly is on my list of favorite steakhouses where I thought I might otherwise starve in need of a good steak.",
          "time": 1511077368
        },
        {
          "author_name": "Peggy Mulligan",
          "author_url": "https://www.google.com/maps/contrib/107765038349930370334/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-O0yT6lC1Nkw/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjWMLeU0vp8rLqfdj3b89YHNL2R_HA/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "I go here EVERY TIME I'm in San Francisco.  The Jack LaLaine's Favorite Salad is all I ever order. It's fabulous!  The restaurant has the original Maltese Falcon from the movie.  The waitstaff is wonderful, the drinks are so good, and the atmosphere takes you back.",
          "time": 1518196054
        }
      ],
