      "reviews": [
        {
          "author_name": "Josh Lancaster",
          "author_url": "https://www.google.com/maps/contrib/116440536345454998576/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-_ox9SN7FqF8/AAAAAAAAAAI/AAAAAAAAI-s/fsrDNgl7uw8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Best steak house we've been to, and we've been to a lot. Let's start with the service, from the moment you walk in they're friendly and inviting and are on top of their game. The wait staff takes over once you're seated without missing a beat, and takes interest in all areas of your experience. They had a three course special paired with wine that was absolutely delicious, and took the time to explain each dish, the ingredients and why the wine was chosen to accompany the dish.  We choose Epic for a special occasion, and they blew it out of the water. On top of it all, we were sat right next to a window with one of the best views of the bridge. If you're thinking about trying out Epic, go for it, you'll love it.",
          "time": 1515175251
        },
        {
          "author_name": "Kevin McGann",
          "author_url": "https://www.google.com/maps/contrib/115459320137598409122/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-mFAdY42jGmo/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjUww3rb2Ko3SwPqKQzG0oHzEp9PvQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "4 weeks ago",
          "text": "Excellent views.  Very fresh and briny oysters.  Good wine suggestion from wait staff.  Had dinner in communal area of bar.  Incredibly almost impossibly fast service.  NY strip with peppercorn and coffee rub was flavorful and juicy.  Only stop from 5 stars was medium rare closer to medium, but this may be from experience in NY where everything is errs on rare side.  This steak was robably what most people at home call medium rare, but lots of steak houses call medium.  It was still delicious, but order rare if you really want cool center.  Steak was really tasty, just need to know what is expected where you order.  NY tends toward less cooked and I was just used to that.",
          "time": 1516769808
        },
        {
          "author_name": "Devin Ramdutt",
          "author_url": "https://www.google.com/maps/contrib/115619047556375390506/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-i1YLy-xmLhA/AAAAAAAAAAI/AAAAAAAAV6U/1JVdXlvGC0U/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 4,
          "relative_time_description": "in the last week",
          "text": "Excellent steaks and great location. Very expensive, but you are paying for the location and an exceptionally well made steak. They know how to do a good Pittsburgh blue, and when you order sides, they are quite large portions. The quality of the meat seemed very high and the tenderness of the rib-eye was perfect.",
          "time": 1519073983
        },
        {
          "author_name": "R. Joe",
          "author_url": "https://www.google.com/maps/contrib/105808413823704879597/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-25AAw40tZe0/AAAAAAAAAAI/AAAAAAAAAG0/uwCz_ha6WEM/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "I picked a great night to take my wife out for her bday. It was 70 outside and we were able to sit on the out door patio, even ask them to turn the outdoor heater off. Drinks were stiff and great. Food was awesome prime rib was a must for myself, my wife had a butterflyed steak as she likes it a bit more cooked on the inside. The sides dishes were good as well. No dessert was ordered. Valet was $20 and quick to retrieve our car. All around it was a great time and place. Pricey but I know that going into it.",
          "time": 1518102042
        },
        {
          "author_name": "Shauna Lacoste",
          "author_url": "https://www.google.com/maps/contrib/103299304612205728328/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-v2Oa-ZvFhcs/AAAAAAAAAAI/AAAAAAAAEg0/EJz1xNunJp0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "I always enjoy my meals here, and I don't even eat red meat! The veggie sides are great and there's usually one or two nice vegetarian/pescatarian starter dishes on the menu that are filling enough to make a meal. Great cocktails, lovely ambiance, plus a stellar view of the Bay bridge make it worth the splurge for a special occasion. The also have a great weekend brunch!",
          "time": 1513145904
        }
      ],
