      "reviews": [
        {
          "author_name": "Francie Smith",
          "author_url": "https://www.google.com/maps/contrib/103863359498890917123/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-Ial8A2aijaE/AAAAAAAAAAI/AAAAAAAAUnI/Qjx5xDILauA/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 1,
          "relative_time_description": "2 weeks ago",
          "text": "TERRIBLE!!! After LOVING the Gracias Madre in LA, we were super excited to try the SF spot but unfortunately, it was very disappointing! It felt like we were in a bad, fast food joint & we couldn't wait to get out of there! First off, I made a reservation days before but when we arrived, we were told \"all of our seats are communal\" (even if you make a reservation).  Had I known that, we would never have gone there to begin with.  So we opted for the bar, which is basically in the kitchen so those seats sucked too!  As for the food - the menu was nothing like the LA menu (which I found strange) but whatever, we went with it.  I ordered chips & salsa & when we opened the basket of chips, there was just a handful of chips for 2 of us. When I asked if this was all we would get, I was told \"that's it\".  So we ordered 2 appetizers (which were gross) & 2 sparkling lemonades and it came to $51.  This place SUCKS & we'll never be back!",
          "time": 1517865179
        },
        {
          "author_name": "Red Rain",
          "author_url": "https://www.google.com/maps/contrib/102641301914120380021/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-rpbCBN6M2Ho/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXslOaiX97l_3l0P4DHDtL7OsMyew/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "This is authentic vegan food! I love the creativity and flavor of the food. The staff is very attentive. The atmosphere is open and inviting. The restrooms are clean. This place is doing a good job! I'd definitely go back.",
          "time": 1516198061
        },
        {
          "author_name": "James Polans",
          "author_url": "https://www.google.com/maps/contrib/114265378145980933404/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-xiQe4_188RM/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVvWQKxTjdlwr1SNhT1N-s-P4Oeug/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "The food here was awesome and definitely flavorful. The place was cozy and all the people working there were smiling, which gave the place a really good vibe. They don't seem to over crowd the place so it was easy to hold a conversation with someone sitting next to you.",
          "time": 1515366991
        },
        {
          "author_name": "Charlene Zvolanek",
          "author_url": "https://www.google.com/maps/contrib/112380826963567561520/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-gtVzT528Ayw/AAAAAAAAAAI/AAAAAAAAAUA/Hnt1p2gUq1s/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "Even on a Tuesday night it was full at 8:30, and with a reservation for two, sat at a communal table. My dining companion is a carnivore, and was relatively satisfied, but not converted. I enjoyed the tamale with the cashew crema. The Bowl Dos was very full of spinach and pineapple salsa, but could use more rice.  The guacamole was a bit bland, but that seems to be the trend in SF. The tortilla chips were nicely house-fried. I'd prefer a tequila margarita with this kind of meal, but they serve sake drinks, wine and beer.",
          "time": 1512610356
        },
        {
          "author_name": "Vaughan Kitchen",
          "author_url": "https://www.google.com/maps/contrib/108622107966239482666/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-HRcU60u1zbM/AAAAAAAAAAI/AAAAAAAAJDo/o26a4SPa3G0/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "2 months ago",
          "text": "I tried a number of menu options and would have been entirely underwhelmed if it wasn't for the Eggplant Tacos. They had a freshness and richness that the other dishes lacked. Of all the things I tried they're the only ones I'd return for. Otherwise the staff were great and the atmosphere was nice. The menu could do with a bit of a refresh",
          "time": 1513224636
        }
      ],
