          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "Don't expect much when you come in here, and make sure you bring a large group of friends. Its an unpretentious watering hole that has a large after work crowd during the weekdays, and is fairly quiet during weekend evenings. When the weather is nice it's great to sit outside with a beer and good company.",
