      "reference": "CmRRAAAAUaKPnkkIvjBN4_RmUupg3uRff6iD6L8-IDlWdIJdtqYohIYwbXHD4uBOmtS7cAdI35U0PxIEocF0q3KE08UHK0RjCMR3YE0L5huSzhiPjWBH3M5aNhkmfoSEXzXeisqxEhD2YiZ8eYQtQo7I03MUgO-sGhQtrrVPaU6qnDeJHxko0mjptD0Crg",
      "reviews": [
        {
          "author_name": "Megan windell",
          "author_url": "https://www.google.com/maps/contrib/106053734837056555951/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-HRXwhs3E-vY/AAAAAAAAAAI/AAAAAAAAaMI/ThYewMOHUcI/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 weeks ago",
          "text": "Holy prime rib heaven! If you love prime rib then you have to go here. Not only is the prime rib amazing but the salad is also to die for. They have a good drink menu and decent wine selection. My husband gets us reservations every year for my birthday. I'm still trying to convince him that we should also celebrate my half birthday here but I haven't succeeded.",
          "time": 1517719118
        },
        {
          "author_name": "Jane Wang",
          "author_url": "https://www.google.com/maps/contrib/108366806147439084612/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-w3Io1juG_iY/AAAAAAAAAAI/AAAAAAAAAAo/9dkDTIMa4Tk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "House of Prime Rib is a classic for SF locals and tourists alike.  We came here recently for a birthday and had a great time.  The menu has a minimum number of choices you have to make so its easy on the indecisive pickers.  The prime rib was very flavorful (though my particular piece was a little fatty) and the service was theatrical, fun, yet attentive.  They took a picture of our group, framed it and gave it to my mom which she thought was the coolest thing ever.  I would recommend this place for celebrations, but the food has been the same probably for 50 years so if you're looking for something exciting and innovative, there are better options.",
          "time": 1516151670
        },
        {
          "author_name": "Jackie Omstead",
          "author_url": "https://www.google.com/maps/contrib/114309676542607305268/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-k2_QQv4n7QI/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXRtcu8OKnFGL3NltFGSt7JbdNPaw/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "Love the food and the service was great.  We will definitely return several times a year.\nHowever it would be awesome if  they could improve by adding some type of sound absorbing material as the dining rooms can get really loud.   So, while this is not a quiet romantic place, the menu is great if you are a prime rib lover.   The drinks are good.   The meat is excellent.   And the rest of the experience is pretty solid.",
          "time": 1519012224
        },
        {
          "author_name": "Dave Rosenberg",
          "author_url": "https://www.google.com/maps/contrib/112296208639034158483/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-PIlnkRWbK9k/AAAAAAAAAAI/AAAAAAAAE8I/1hvn4F8XKrA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "Delicious prime rib, wonderful experience. You get exactly what you'd expect here - old school vibe, classic cocktails, and great meat. The king's cut was definitely too much food, but in a good way. We loved watching the carvers work their magic and our server was excellent. The creamed corn was delicious and the mashed potatoes were generally better than the baked potato, but that's to be expected.",
          "time": 1517428502
        },
        {
          "author_name": "Justin Snider",
          "author_url": "https://www.google.com/maps/contrib/117650815944450528769/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-iGjXub3cE-E/AAAAAAAAAAI/AAAAAAAAniA/aOxnfcEbfCY/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "4 weeks ago",
          "text": "It's good but not great. The menu is limited but they do it well. The atmosphere is decent especially for such a busy place. The service was fine but the staff wasn't really friendly. House of Prime Rib is worth going to once if you live here or visit often. Not sure that I would go back again.",
          "time": 1516734556
        }
      ],
