          "author_url": "https://www.google.com/maps/contrib/118187071229971900779/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-s0mrRg8-dNs/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXbJFHwoLzD2F06W-G6Xnhryiijyg/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 1,
          "relative_time_description": "a year ago",
          "text": "i do not know why all the females who 'work' here aren't automatically diagnosed with bipolar disorder or psychosis. i have a fantastic imagination and sound system. my aunt even said that they earn their money. my aunt would not hire me to work in her stupid clothes store. my aunt feels insecure then turns around and mislabels me as bipolar. i am also better looking than these females. i don't know why these are in business. i don't know why the government considers this a legitimate occupation and then an arm of the government wants to be insecure and tell me i am mental. i have a fantasy imagination that is well noted and i don't know why someone would pay all this money to look at these people who probably got bad grades in school on purpose. they probably only think they are so great all the time. i don't know why i can't get acknowledged sometimes. my great grandma 6' in the 1800s. i don't know why other real females can't be acknowledged and these people selling but cheese are idolized.",
