      "reviews": [
        {
          "author_name": "Julia L.",
          "author_url": "https://www.google.com/maps/contrib/112894576513953485979/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-1UmRZpYX1t8/AAAAAAAAAAI/AAAAAAAAAgs/Xi19x7MMKJ4/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "One of the best dining experiences of my life. Wonderful service, amazing flavors, delightful experience. We were seated at the bar which was surprisingly comfortable, and only ate off the dim sum style carts they brought around. We were full after sharing about 12 plates between two of us and sharing a half dessert- it was perfect! On a Thursday night in January we didn't have reservations so arrived about 50 minutes early and waited in line outside with a handful of others, crossing our fingers. It was actually a fun experience- watching through the window while they prepped. Obviously we got lucky and it was more than well worth the wait!!",
          "time": 1516939700
        },
        {
          "author_name": "Tu Lam",
          "author_url": "https://www.google.com/maps/contrib/111414489430298948350/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-Gsv7rI3H6J4/AAAAAAAAAAI/AAAAAAAA8Sw/gY4qds0XDQw/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "I didn't come here for regular dinner service because it's really impossible to snag dinner reservations.   I would love to come back here for an actual sit down dinner.   My friend and I got tickets for their cook book release party which was basically easy whatever they're serving and add much as you like with 4 options for drinks (wine and sparkling wine).  No formal tables add we walked around and grabbed food for a few tables or as staff walked by with trays.   Every thing was delicious.   I think we had about 8 different dishes that night.",
          "time": 1512410248
        },
        {
          "author_name": "Xavi Carb",
          "author_url": "https://www.google.com/maps/contrib/117658884203942845537/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-wQFGA4KOEPM/AAAAAAAAAAI/AAAAAAAAAAo/SsLu-FnmDmI/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 1,
          "relative_time_description": "a month ago",
          "text": "We had booked a table for 4 and we had to wait around 40 minutes. The host did not manage the situation well and seemed stressed so much so that he left and as new diners came in they thought we were the hosts.\nI did not like the food. Most dishes tasted of cheese and salt without much flavour.\nThe good rating of this restaurant makes me think how different we all are. We were in SF on holiday and we invited our local friends for what we thought was a foodie treat but we were all disappointed.  We enjoyed the night out with our friends but no thanks to this restaurant.",
          "time": 1516429274
        },
        {
          "author_name": "Jan Mico Villar",
          "author_url": "https://www.google.com/maps/contrib/109209700659987662591/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-Ki7b3QNVpgw/AAAAAAAAAAI/AAAAAAAAARI/7paa8LJHy-c/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 months ago",
          "text": "It is now my favorite restaurant in the city. The service is great very accommodating, and the concept is really appreciable. I had a very good impression about the food it was just superb!! \n\nIt is a good spot for dates too. I think this is the most wonderful restaurant in San Francisco.  \n\nAs a tourist, I really recommend this restaurant to visitors it is worth of your time.",
          "time": 1509755792
        },
        {
          "author_name": "Derrick Wong",
          "author_url": "https://www.google.com/maps/contrib/115190035783876965764/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-oAd0WhMx1KM/AAAAAAAAAAI/AAAAAAAAAAA/eXyS6gXOVBo/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "This place is a great experience, an American-Asian fusion dim sum restaurant. The food here never disappoints if you are able to get a reservation. It may be a bit pricey for the little bites of food you receive, but keep in mind that they put in incredible amount of effort in getting the flavor and presentation just right. Highly recommend for those who are on the fence",
          "time": 1514094916
        }
      ],
