          "rating": 4,
          "relative_time_description": "2 weeks ago",
          "text": "I went here for the first time with my friend. Restaurant looks really good from outside and it feels more simple when you get in. It is dark inside and you may think that its romantic bit it's really not because tables for two are next to each other. So literally you can hear what you neighbors are talking about. The food was really tasty and good. But its sooo over priced!",
