          "profile_photo_url": "https://lh3.googleusercontent.com/-XXsZocs6dXw/AAAAAAAAAAI/AAAAAAAAEcI/8HzXx2T442E/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 4,
          "relative_time_description": "2 months ago",
          "text": "I recently revised my 3 🌟 rating to a 4 🌟 rating, as the customer service, quality of food, and cleanliness have all improved as of late. I'm sure there have been several new employees, and the senior staff have stepped up their game, considerably. Still, there's room for improvement, but all-in-all this is becoming a decent place for a meal at any time of the day 😊",
          "time": 1513540854
