      "reviews": [
        {
          "author_name": "Jonathan Durand",
          "author_url": "https://www.google.com/maps/contrib/106560466931921706099/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-UESKyFHekE8/AAAAAAAAAAI/AAAAAAAAOAY/S5x5ScRI7ao/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "This place is interesting  how the waiters bring hot foods on the cart and bring it you on the table  if you want them.  \n\nRemember to carefully select the foods and check the prices.  The food may look good but don't hurry to grab it  Without knowing the price.  Some food is small and pricy so look our for that.  \n\nI hear many people complain  how expensive on their bills not knowing the prices and ended paying it.  \n\n  But over all great service and the dining  environment. I would come back again \n\nRecommended to reserve the table.",
          "time": 1512763643
        },
        {
          "author_name": "Irwin Kwong",
          "author_url": "https://www.google.com/maps/contrib/101002945821579292572/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-G1RWEpjtOaw/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVlK6DTCWQLV8sXrYyBqcl6ndGSoQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "Pretty good Dim Sum. Efficient and friendly service elevates the classic dim sum fare, while the occasional modern versions provide the memorable highlights. Points for their table side Peking Duck, it's not something you typically see at Dim Sum houses. Tight seating, cart service, and Quality teas add to the authenticity of the dinning experience.",
          "time": 1514340589
        },
        {
          "author_name": "Jamie Cohen",
          "author_url": "https://www.google.com/maps/contrib/110261891693154448316/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-kMwcFFofIJs/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVPPB2N_3YzwIHifEU_eM8dIMBBWw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 2,
          "relative_time_description": "in the last week",
          "text": "We were recommended to this place as a must try I'm torn between giving it a one or a two there was only 2 dishes that were average most dishes were below average and one looked inedible and half the dishes were room temperature or cold and considering how much it costs for an average at best dim sum also with below average service I'd never go back or reccomend it... the only 2 dishes I'd recommend was there pot stickers and there duck",
          "time": 1519091297
        },
        {
          "author_name": "Tay Feder",
          "author_url": "https://www.google.com/maps/contrib/110508327199203509796/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-WzoOAfCixGM/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXXc4cBzmUb8uRZMfRnyS6tgg1eyw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 3,
          "relative_time_description": "in the last week",
          "text": "Excellent dim sum but overpriced for what you get. The soup dumplings and shiitake were exceptional (5/5), and the other dishes were solid (4/5). We paid $45/person for brunch without drinks. If the venue had $$$ or $$$$ on Google maps’ profile instead of $$, I would rate 4 stars.",
          "time": 1519013115
        },
        {
          "author_name": "Kevin Jaskela",
          "author_url": "https://www.google.com/maps/contrib/116018211746666534134/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-lUvwpMs7LIk/AAAAAAAAAAI/AAAAAAAAHUE/_fd_YUaEtBo/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "Some of the best dim sum in SF. Always a lively crowd so make sure to come hungry but not starving, you might wait a bit.",
          "time": 1518678191
        }
      ],
