      "reviews": [
        {
          "author_name": "Christopher Lee",
          "author_url": "https://www.google.com/maps/contrib/109507200613062627745/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-txr0imt_ZOY/AAAAAAAAAAI/AAAAAAAAV2c/oByOQJvoqcY/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 3,
          "relative_time_description": "a month ago",
          "text": "It’s a nice, well lit restaurant with a nice ambiance to it. The starting chips are excellent, though the salsa is a bit thin. Service to start is fast, and chips and drinks are refilled quickly. You also get a tall decanter of chilled water at seated tables. \n\nAs for the food: the meats we had were excellent. Vegetables were alright. The tortillas we found were very dry and floury, which took away a lot of the flavor. \n\nThe menu is well labeled for gluten free options and there does not seem to be cross contamination in marked foods (though there is no flag or different plate color for gluten free orders). If this review is updated within 24hrs then you will know the food is not celiac safe!\n\nIt’s rather pricey to dine here for the quality of food. Not a bad option, but would not be my first pick.",
          "time": 1516638243
        },
        {
          "author_name": "Raquel B",
          "author_url": "https://www.google.com/maps/contrib/105191897253249906351/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-K7tb75ZQx_Y/AAAAAAAAAAI/AAAAAAAAHD4/h7iWowyLOg0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "Everything on the menu is delicious! Love the guacamole that is prepared fresh at the table. Nice tequila selection. Comfortable seats. Has a nice patio that gets sunshine earlier in the day. Great spot for lunch or dinner and happy hour too.",
          "time": 1518651692
        },
        {
          "author_name": "James Brogan",
          "author_url": "https://www.google.com/maps/contrib/115327274311461839250/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-bjCM3fmbtbc/AAAAAAAAAAI/AAAAAAAAIRk/EU4xRkmph8s/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 4,
          "relative_time_description": "in the last week",
          "text": "Amazing upscale Mexican. I still like taco trucks on the flipside. But some very creative, flavorful and colorful dishes. Great place. A tad pricey but worth the experience.",
          "time": 1518989912
        },
        {
          "author_name": "Ashley Baer",
          "author_url": "https://www.google.com/maps/contrib/111176201251067190462/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-Qba4rfx-o0Y/AAAAAAAAAAI/AAAAAAAAAB4/vpbAS4g_K6w/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 3,
          "relative_time_description": "2 months ago",
          "text": "The food was good, but perhaps a little upscale or authentic for my tastes. I think I'm so used to super greasy and cheesy Mexican food that anything that's NOT that is too different for me. The food here was fresher, cleaner, and a little under-seasoned. I wanted more \"oomph\".\n\nAlso, the service, while professional and attentive, was slow, and I think this had to do with the food more than anything. Don't expect a quick meal here.",
          "time": 1512958045
        },
        {
          "author_name": "Lena Robinson",
          "author_url": "https://www.google.com/maps/contrib/113364380688073083982/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-isPSIhK7zfw/AAAAAAAAAAI/AAAAAAAABtk/CvfuInp0BA8/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 3,
          "relative_time_description": "2 months ago",
          "text": "Good food but pricey. Entrees were cold when we finally got them.  Very busy with holiday lunch parties so service was very slow. I love the ambiance. Decor is festive and elegant. Staff were nice.",
          "time": 1513650219
        }
      ],
