      "reference": "CmRSAAAA0E_GgzyhQFtoG5pCA9kaGH-y3E8xqE1amIEK8YmkIFtR0QkgI1CkzpBxcc6ch5D60CAGRd5L8heSRvl92fGzDKubby5nmD-yQ-d76NQmbLQ8YEjc6Yx9stXCtGnifL6QEhDd55fRgJdpsVlKR8EoMmXMGhRNnHNFVxoLpbiaiKkEmIe59bg8vA",
      "reviews": [
        {
          "author_name": "Robert Shopshear",
          "author_url": "https://www.google.com/maps/contrib/105597257208854988185/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-OGu63towzTw/AAAAAAAAAAI/AAAAAAAADLM/FkulOCiO0Wk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "First time at the Mikkeller bar and it was a weekend. They started serving Brunch recently and if you get a chance try the corn beef and hash. This is no store bought corn beef and it was fantastic.  It went well with the solid beer selection.  My only gripe is the price of the beers. They do have a good amount of one off and unique beers but the price tends to be a bit higher than most places.",
          "time": 1518551565
        },
        {
          "author_name": "Marc Hill",
          "author_url": "https://www.google.com/maps/contrib/111563852988013057365/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-jW-OGY62iHM/AAAAAAAAAAI/AAAAAAAAHwk/E2Dd4O9lgfc/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "A modern twist on a traditional German beer hall with an overwhelming choice of flavourful beers to choose from. The bratwurst is moist and delicious served with plentiful mustard and sauerkraut. Cheerful casual waiters make sure your glass never goes empty and share their knowledge liberally.",
          "time": 1518825180
        },
        {
          "author_name": "Renaud Perrier",
          "author_url": "https://www.google.com/maps/contrib/106624517902341000081/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-cAGl9LcWoXY/AAAAAAAAAAI/AAAAAAAAycY/eQ-fkPVJCds/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 5,
          "relative_time_description": "4 weeks ago",
          "text": "Superb atmosphere, a very nice restaurant. Eat at the majestic bar, wonderful. I tasted the pepper steak: really amazing! Some really good bites, lot of good drinks. I will go there for lunch, for after work and drinks, but maybe not for dinner (noisy, full)\nBut indeed, a very good address",
          "time": 1516801815
        },
        {
          "author_name": "Joe Sassaman",
          "author_url": "https://www.google.com/maps/contrib/107157057935615146260/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-YO94zE0Kj7w/AAAAAAAAAAI/AAAAAAAAGSQ/Pu-wvsYQ7AU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "Great beer selection. Tasty food. Did I mention the variety of beers on tap?  And not just a bunch of crappy beer but amazing beers served properly. This is a beer lovers bar. Yes the neighborhood is still a little sketchy but that makes this place legit.",
          "time": 1519022171
        },
        {
          "author_name": "Mark Litman",
          "author_url": "https://www.google.com/maps/contrib/109336344794241344643/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-m2ygXGNUCx4/AAAAAAAAAAI/AAAAAAAAGoc/_XiXbFLfkhA/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "One of the best bars I've been to in SF. The beer choice is very wide and changes often. The food is really nice too. Gets a bit noisy at certain hours but with voices of people talking, definitely not loud music. I loved visiting this place at odd hours, sit at the bar and have conversations with strangers.",
          "time": 1512965059
        }
      ],
