        {
          "author_name": "Irene Personal",
          "author_url": "https://www.google.com/maps/contrib/106614479557835620289/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-P3HM54lomqA/AAAAAAAAAAI/AAAAAAAAFTI/BDMzMLMijV0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "You can be sure you're going to be taken care of as it's a family owned traditional style, yet classy and special experience dinning at Waterfront. Service is friendly, attentive. Staff know the menu and can make recommendations or take care of special orders and preparations if you're particular or are allergic to any food items.",
          "time": 1518895813
        },
        {
          "author_name": "Cute Dragon",
          "author_url": "https://www.google.com/maps/contrib/103647769743576208975/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-raC6eer0drk/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjX5Q5Ndz5r086-O9aI5A-ztWxvGKg/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "Best wonton soup ever. Valentine's service was excellent\n They helped us work out Uber for the first time. Great wine. We sat at the bar after dinner. Nice view. Very romantic.",
          "time": 1519198443
        },
        {
          "author_name": "Nirushan Udayakumar",
          "author_url": "https://www.google.com/maps/contrib/118412925048994608074/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-HfpLlqkpDYs/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVirI0ZO3asopyDyWIor1NnFIqZng/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 4,
          "relative_time_description": "3 weeks ago",
          "text": "This restaurant is located by the water so you have an amazing view while you dine. The food, and seafood in particular, is all really good, however the portions are really quite small. Even after an entrée, drink and dessert, I was still left hungry",
          "time": 1517438368
        },
        {
          "author_name": "Chad Allen",
          "author_url": "https://www.google.com/maps/contrib/106429123645828682385/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-2JNbWtxBQdA/AAAAAAAAAAI/AAAAAAAAJN8/BBO3mt2_2io/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "Great view with an extremely friendly staff! The seafood appetizer, nutella dessert and Paloma drink were a must! I highly recommended this restaurant.",
          "time": 1518148682
        },
        {
          "author_name": "Delphine Bernard",
          "author_url": "https://www.google.com/maps/contrib/101942499084554718242/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-ZWxV0g-o6Q4/AAAAAAAAAAI/AAAAAAAAABE/bIcKrsDL6vs/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 3,
          "relative_time_description": "in the last week",
          "text": "Amazing view\nIf you ask for the hot lobster and hot crab then it is great. We had previously the cold version as well as the cold seafood platter but nothing stunning.\nDessert: the fondant is too cooked and not melted chocolate anymore.\nWine: cakebread sauvignon blanc - very good",
          "time": 1519083528
        }
