          "text": "With dishes around $10 it´s good value for money. \n\nSpeedy and cordial staff. There was a small line (around 10 people) that was attended very quick (they have that manual waiting list on paper). Groups of 2 or 4 is recommend to be seated fast.\n\nBoba Tea Milk is a interesting choice if you like tea in general.\n\nGood surprise.",
