      "reference": "CmRSAAAAvb2DKs_OOazACQ__mSmXW7PjP_26cfiKsJ6-7EGz8uid7IiwqplAXdEmOWKGZ4PKEZQDBopvapqZ12U-7raNqYvtlWemrsvA4xnYZMiiqLVXFf81PBOQJGvcXGdM09DhEhCNA0FpB2n1TS6eVP-fGlATGhRxf-Q_I2teq6WUyCFv7WKMSKzKWg",
      "reviews": [
        {
          "author_name": "Richard Redding",
          "author_url": "https://www.google.com/maps/contrib/111537808335734264325/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-JlZIkyNGr_g/AAAAAAAAAAI/AAAAAAAAANo/sWeQdEjzDTc/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 3,
          "relative_time_description": "a week ago",
          "text": "Good food but expensive.  A full breakfast with OJ and coffee costs $20.  I was a tourist needing breakfast in downtown San Francisco, and there seemed to be very few choices within walking distance of Union Square.  I tried Honey Honey and ordered the 2+2+2 platter -- 2 eggs, 2 pancakes, 2 slices of bacon.  The orange juice ($5 extra) was fresh-squeezed on the spot, and was delicious, but it was served at room temperature, not chilled.  I was satisfied with the breakfast, very tasty, but wanted to give a note of caution about the prices.",
          "time": 1518656545
        },
        {
          "author_name": "Tim Saunders",
          "author_url": "https://www.google.com/maps/contrib/113117354557397452253/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-z0xgdoHMrG8/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjU85vsagGZcA7bBzjf10JIKNpIG1Q/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "There was a huge queue to get in, then another queue to order. Overall it must have taken 45 minutes to order. I am not sure if this is because it was a holiday, or if it is like this every weekend.\n\nThere is a good selection of vegetarian options, although too much avocado for my liking. Still it wasn't hard to find something to my liking.\n\nWhen the food arrived it was tasty, although a bit on the cold side. I might have gone for some dessert, but that would mean queuing up again. You have to know what you will want when you first order.",
          "time": 1516106219
        },
        {
          "author_name": "Kyle Maxwell",
          "author_url": "https://www.google.com/maps/contrib/103137830136409510693/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-fIr9ItMFnNE/AAAAAAAAAAI/AAAAAAAAE6E/MYa0GFXFx5M/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "Big menu, and pretty affordable. Order at the counter and they will serve you your food. I didn’t get an option for a side with my sandwich. I got a California sandwich and an almond cookie for around $12. Decent service and decent atmosphere. If I lived closer it would be a place to go when I couldn’t decide.",
          "time": 1514943441
        },
        {
          "author_name": "Monica Carlton",
          "author_url": "https://www.google.com/maps/contrib/114378352910400452535/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-k5vVvXWfC1g/AAAAAAAAAAI/AAAAAAAAAG8/33O5xxoJsD4/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "Had the honey honey cake with some coffee which was very yummy but make sure you like really sweet food. Both the sweet and savory crepes are great. The service is quick and the servers and bussers are nice and efficient and helped us get a table once we were at the counter ordering.",
          "time": 1518382867
        },
        {
          "author_name": "Joel Beachum",
          "author_url": "https://www.google.com/maps/contrib/114798382592228929092/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-JrTf8n60GgE/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVcLb9PN-ZcHvBhkFbW8gTK3miGHw/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "This place is so good and they have a nice selection for breakfast. Lots of choices, but you can definitely find something good. Eggs are stove of the best. Crepes are excellent. Staff is very helpful and very cool looking atmosphere.",
          "time": 1515243380
        }
      ],
