      "reviews": [
        {
          "author_name": "Sofia Sodhi",
          "author_url": "https://www.google.com/maps/contrib/116475180264841838317/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-hIpc83mQoEc/AAAAAAAAAAI/AAAAAAAAADk/fK4cAzzT7eY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Hell yeah! This place is great! They serve great food,  like burgers and sushi. They even have delicious desserts such as ice cream sandwiches with cookies made in-house. Please go here. I beg you. If you're on the fence about this place, give it a try. If you don't like it, you need to see a doctor who checks taste buds.",
          "time": 1515468829
        },
        {
          "author_name": "Vipin Kumar",
          "author_url": "https://www.google.com/maps/contrib/111430567729692793877/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-YYLwnQJU4Fw/AAAAAAAAAAI/AAAAAAAAAAA/MY073tOMdb0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "If your'e going in a larger group then you have a better chance of trying out all the burgers. However, if you're going in a small group of two or three people, I suggest to try a slider. A normal sized burger is 6 ounces and costs about $12/$13 while sliders are 3 pieces of 2 ounces each and cost the same $12/$13 but the advantage is you can try more burgers in one go. While there can be one slider, the others can order one burger each. For me and my friend, we did a slider, a normal burger and truffle fries. Must haves - Umami burger and Truffle fries. Happy hour made the truffle fries possible for just $3. Glutton heaven.",
          "time": 1515229048
        },
        {
          "author_name": "Johnny Ma",
          "author_url": "https://www.google.com/maps/contrib/110590184305769403864/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-khpNVG-fEWA/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjUfJZYVom-8G0nY5PLUH_bSwEUrnA/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "Incredibly delicious burgers. This is one of the few places that serves the impossible meat, if no one told me it wasn't meat I would never know the difference, the only way to really tell is to have another burger side by side for comparison. The truffle burger is to die for, if you are a truffle lover, this is burger alone is worth the visit. The place is a bit pricey, I would go back only when im really craving that truffle burger or when I want to take my vegetarian friends to a burger joint.",
          "time": 1518990813
        },
        {
          "author_name": "Henry Mckenzie",
          "author_url": "https://www.google.com/maps/contrib/113852053063007161762/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-sEEnxYuq9Gc/AAAAAAAAAAI/AAAAAAAAAAo/O52OR7Eo7JU/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "Burger is solid, bacon is thick and ample but rarely crispy enough to my taste. It's worth trying! Friendly and quick service.",
          "time": 1518160702
        },
        {
          "author_name": "Verna Bennett",
          "author_url": "https://www.google.com/maps/contrib/106979749802171355051/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-BhKuyhyzPpc/AAAAAAAAAAI/AAAAAAAAAAo/drCtHH9NoNQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "in the last week",
          "text": "Outstanding! BRAVO!!!  Perfect - FRESH Much positive has been reported and it's all true. I have never had a burger this good.",
          "time": 1518679493
        }
      ],
