      "reviews": [
        {
          "author_name": "Ryan Blodgett",
          "author_url": "https://www.google.com/maps/contrib/100474227160320126238/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-vAnK1McdYdA/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXsoNUIJzaxweU9CFAboPtupMQv5g/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "Excellent quality seafood, which is expected when that's all a restaurant offers. We received personable service from bartender Emily despite being busy, with knowledgeable wine pairing recommendations. We were able to snag the last two bar stools before the Friday dinner rush (we're sad we just missed their happy hour); if you prefer a table reservations are recommended.",
          "time": 1518293009
        },
        {
          "author_name": "Emily Crow",
          "author_url": "https://www.google.com/maps/contrib/102367029564135461940/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-eI0phBF6ntc/AAAAAAAAAAI/AAAAAAAAALs/5U1VrQMstR8/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Wow, really fantastic. The crudo sampler and chowder are exquisite. So nicely done. Fun place and super friendly people both at and behind the bar. Recommended by a friend, really glad I went.",
          "time": 1516427216
        },
        {
          "author_name": "Yara",
          "author_url": "https://www.google.com/maps/contrib/100817081259773449889/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-4d7HuG1kVGw/AAAAAAAAAAI/AAAAAAAAASM/pnFjuoqxtnM/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 months ago",
          "text": "If you like raw fish, you will not be disappointed. The food is delicious and creative. The portions are quite small but so yummy. Great wine as well. Lovely staff and nice decor.",
          "time": 1509204790
        },
        {
          "author_name": "the donger the donger",
          "author_url": "https://www.google.com/maps/contrib/113966505626310318337/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-EsPWAEWKNH4/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjU0ETp4FVXgFnxnp4jMR_jCHzbbqg/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 weeks ago",
          "text": "The good: Excellent happy hour, delicious food,  friendly and patient staff, nice location, comfortable restaurant. \nThe bad: Difficult to find close  parking....",
          "time": 1517462723
        },
        {
          "author_name": "Stephan Rabimov",
          "author_url": "https://www.google.com/maps/contrib/116525128397012233701/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-VxqieAW4crM/AAAAAAAAAAI/AAAAAAAAWqc/9yMexfUzFWM/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "4 weeks ago",
          "text": "Head here for happy hour to experience SF’s best seafood - from oysters to clams to chowder. #approved PS: Slayer was the best server ever, polite, prompt, and full of smile.",
          "time": 1516758059
        }
      ],
