      "reviews": [
        {
          "author_name": "Michael Piccirilli",
          "author_url": "https://www.google.com/maps/contrib/110607141217026470316/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-guTHzu4GkZ8/AAAAAAAAAAI/AAAAAAAAAYc/j-_N5yY-VYs/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 weeks ago",
          "text": "Great pizza. Get the deep dish. Good for dining in or take out. It can get busy so if you plan on eating there be prepared to wait for a table.",
          "time": 1517809170
        },
        {
          "author_name": "Nicola Sicchieri",
          "author_url": "https://www.google.com/maps/contrib/102252950410918497340/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-wOI_dc6e4uc/AAAAAAAAAAI/AAAAAAAAWUg/dcTmc833w1Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "Love the deep dish with cornmeal crust! It’s not that heavy as the traditional flour dough and it has a very characteristic taste. They are quite fast which is rare for deep dish pizza place.",
          "time": 1519108372
        },
        {
          "author_name": "Catherine Marylander",
          "author_url": "https://www.google.com/maps/contrib/103253244282464696677/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-dP2mDJwOvNs/AAAAAAAAAAI/AAAAAAAAFYI/JQoHIPgrMNA/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "THIS IS MY FAVORITE DEEP DISH OF ALL TIME! And definitely my favorite pizza in San Francisco.  Great vibes - perfect for a casual date night with a bottle of wine or a night out with a few friends. The Classic Deep Dish is AMAZING.",
          "time": 1513027217
        },
        {
          "author_name": "Michelle Mellish",
          "author_url": "https://www.google.com/maps/contrib/102056869491242062429/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-cIRIFjicL74/AAAAAAAAAAI/AAAAAAAATAo/aZXyZEUY0js/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "30 minutes wait for deep dish is well worth it! Not stodgy or greasy, just really great pizza. Good beer and cocktails with friendly service. New favourite pizza in SF",
          "time": 1512935441
        },
        {
          "author_name": "Karina Sangster",
          "author_url": "https://www.google.com/maps/contrib/106247619084802301902/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-OBITG15GdPQ/AAAAAAAAAAI/AAAAAAAAtFY/Oa1ZxblUZKQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "5 months ago",
          "text": "This was an AMAZING PLACE.\nFirst of all it's not a touristy place. It wasn't easy to locate this place from simple view but when we found it, it was worth it. \nIt was crowded. But we didn't wait much to get a table. Also noisy but it was a youthful ambiance. Got a few minutes to the waiter to bring us the menus but we were okay. \nLoved everything. We got a Mixed salad which was perfect for 3 persons. And also we got a Italian Combo Deep Dish Pizza. We got to wait a little but but the salad really entertained us. The pizza arrived and it was amazing! The ingredients were fresh and everything tasted super good. The pizza was enough also for 3 persons, we took 2 slices on a box. \nI dunno but I am definitely coming back next time I go to San Francisco because this is hell of a good place to meet locals and have a nice dinner!",
          "time": 1505244239
        }
      ],
