        {
          "author_name": "April Kee",
          "author_url": "https://www.google.com/maps/contrib/112671222161802003227/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-xEHqudkCGzo/AAAAAAAAAAI/AAAAAAAABG8/nuGuqSgqQcM/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 3,
          "relative_time_description": "a month ago",
          "text": "Embarcadero location:  I wish the employees would eat somewhere else.  Not to sound mean but it is annoying. They are loud and don’t really care about the customers.  Have some decorum.  Food is delicious otherwise and I would have given it more stars if not for the said experience.  Thanks.",
          "time": 1516138646
        },
        {
          "author_name": "Tasneem Nomanbhai",
          "author_url": "https://www.google.com/maps/contrib/106168094230464858075/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-WJNl0B-_A-s/AAAAAAAAAAI/AAAAAAAAD5Y/RBbPc3T9vfg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "3 months ago",
          "text": "I'm not a tourist, but I've been here a few times. There are 3 locations right by the water. Their food is good, albeit overpriced. I think soup bowl is a waste because there is very little soup and lots of bread that people end up discarding. Such a waste. However, the bread is delicious. I liked their veggie sandwich the most - so much so the second time around I had them add some turkey to the veggie sandwich and it was perfect. Get a side cup of tomato soup instead - you'll get more for your money.",
          "time": 1510118501
        },
        {
          "author_name": "william crouch",
          "author_url": "https://www.google.com/maps/contrib/105875128755198012075/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-B7fMgarcv_k/AAAAAAAAAAI/AAAAAAAADqc/u7_9n0c4cd0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Good food and good service. Crowded at peak times with little inside seating space. The Snickerdoodle cookies are the bomb.",
          "time": 1515253172
        },
        {
          "author_name": "James Smith",
          "author_url": "https://www.google.com/maps/contrib/112452845746562251738/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-gU7nWOnD8qM/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVPhRLlZwW7wY_JpnV_TMW6kuHLGQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 2,
          "relative_time_description": "2 months ago",
          "text": "Every clam chowder I've ever had is better than this. Grill cheese was charred. Rude red headed guy at the front can be profitably replaced with an automated kiosk.",
          "time": 1513817622
        },
        {
          "author_name": "Dhananjay Mani",
          "author_url": "https://www.google.com/maps/contrib/106372212289061783290/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-fptCsisqfjQ/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXiBWKWgE4oDyK6cgrchPjpBqvTzw/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 1,
          "relative_time_description": "5 months ago",
          "text": "We went to this place for lunch and we order both \"The purist avocado and The pesto avocado toast\". I also ordered \"Toasted California club and  California Veggie Sandwich\". I don't have any complaint about food except my order was sitting on the counter for 15 minutes. I was standing there and the guy who was serving orders had no idea my orders are sitting there. He was confused between different orders however I observed they are using order management system. I don't know why he was so confused. After waiting and looking at my order sitting on the counter for 15 minutes, he called my number and gave me additional food item that was not ordered by me. I told him this is not order and he got offended. I am giving one star because of poor service. Other than that food was aright.",
          "time": 1505256690
        }
