          "profile_photo_url": "https://lh5.googleusercontent.com/-lS0CGv5vLCg/AAAAAAAAAAI/AAAAAAAAA4w/wcwTdm8R-pY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "It's chipotle. So ya. \n\nThe really nice thing is that they're really fast here. Also they're nice. The restaurant itself is nicely laid out and clean and up to date. \n\nPro tip. Order 2 chicken tacos and it costs under $7.",
