          "rating": 3,
          "relative_time_description": "10 months ago",
          "text": "To find nice place to eat in San Francisco is quite hard but Chipotle is always the solution. Their menu isn't huge but everyone can find something to eat , they even have two choices for vegan/vegetarian which I was very surprised. Food is tasted and reasonable for the amount. Just one bad side of this fast food is that one employee wasn't patient with us. It was our first time to try and we don't know how it worked. We understand they need to work hard but please be more patient with people and try to explain to them the concept! By doing this I am sure you will earn more customers who will come back to this store, right?",
