      "reviews": [
        {
          "author_name": "Julie Williams",
          "author_url": "https://www.google.com/maps/contrib/100723222869830231268/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-hQqCLQQM5cQ/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjU6o1U7WkzaC1O3wouJPHrxG2ZOGQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "This place is awesome everytime i love bringing people here is expensive but i love the atmosphere.  Very unique. Will always come back",
          "time": 1516995661
        },
        {
          "author_name": "Vishrut Patel",
          "author_url": "https://www.google.com/maps/contrib/105606727421283641018/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-R3RqHkXLAK0/AAAAAAAAAAI/AAAAAAAAGSY/Z4NhkYByIoY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 3,
          "relative_time_description": "2 months ago",
          "text": "We had to wait for about an hour and the ‘bartender didn’t show up for his shift’. So no bar to hangout at. Pretty unprofessional for a giant restaurant like that to have such issues. \nThe menu changes from a year ago weren’t very well received by me and my wife, we are both vegetarians. \nStaff was courteous and we always love the ambiance of the rainforest cafes!",
          "time": 1512338866
        },
        {
          "author_name": "Kimberly Reetz",
          "author_url": "https://www.google.com/maps/contrib/104087117369514833290/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-EdXj-tgKPIs/AAAAAAAAAAI/AAAAAAAAAEE/ccBKztfhMqM/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 2,
          "relative_time_description": "a month ago",
          "text": "Ridiculous prices, tacky decor, insane parking and no one speaks English. Worth $40 for 2-yr old child & 2 adults. Bill $90 (no alcohol or expensive menu items) PLUS ADDITIONAL FEE FOR EATING IN SAN FRANCISCO!!!",
          "time": 1514154526
        },
        {
          "author_name": "Joe Ison",
          "author_url": "https://www.google.com/maps/contrib/103218650183229091021/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-XswijxpT3JU/AAAAAAAAAAI/AAAAAAAAABY/s2gyjsE8WmY/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 1,
          "relative_time_description": "7 months ago",
          "text": "I have been to the one at Disneyland in Anaheim which was great.  This one a similar atmosphere but the service and food where far from good.  Our order took 45 minutes my wife's med rare steak came out like a hockey puck and my plate came out without the shrimp.  We sent the steak back and I had to point out my missing shrimp.  My server said \"oh ya I think your right\" about my missing food.  As far as my wife's steak the manager came out with a properly cooked steak, but had to stand over her while she cut into it.  Making us feel uncomfortable.  Made us feel like we where unreasonable for wanting our food cooked to what we asked for.  We where charged full price for everything and not offered any comp on anything.  So our server had to pay the price so we comped ourselves with his tip he would have gotten.  ",
          "time": 1501082028
        },
        {
          "author_name": "Kelly N",
          "author_url": "https://www.google.com/maps/contrib/111194622989780799448/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-GNaHgH4bDD8/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjUHoXL1yLVf0YJ7-pNY3cAdYeBw1A/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "3 months ago",
          "text": "Overpriced but still a fun place to visit once.\nThe staff was friendly enough and food was good, there are just so many other options for a more authentic experience in the neighborhood there.\nThe bar stools are the bottom half of animals though, which is super cute. \nWe got here right as they opened and ha to kind of wander around to find someone but it all worked out",
          "time": 1511334587
        }
      ],
