      "reviews": [
        {
          "author_name": "Henry Levin",
          "author_url": "https://www.google.com/maps/contrib/100566898505810038017/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-v0YSgkUEXXM/AAAAAAAAAAI/AAAAAAAAAd8/0TMiW_UROmE/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "Have never seen such a selection of whiskeys. It's rather pricey but the location is worth it I suppose. I tried 120 proof scotch, don't remember the name but advice to the novice like me - be aware, it's a fire in a glass.\n\nGreat place to go with friends or coworkers after work. Prepare to spend some money buy you will enjoy it.",
          "time": 1517170824
        },
        {
          "author_name": "Raquel B",
          "author_url": "https://www.google.com/maps/contrib/105191897253249906351/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-K7tb75ZQx_Y/AAAAAAAAAAI/AAAAAAAAHD4/h7iWowyLOg0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 3,
          "relative_time_description": "a week ago",
          "text": "Food is great and booze selection on point. If you're a whiskey lover go here! It's on the water so nice view and decor feels like Hardware Restoration. Fried chicken is amazing and they use cool glassware for all different drinks. Mac n' Cheese is delicious too. Great location for a date. Call ahead if you're coming with a group to have a table reserved.",
          "time": 1518651667
        },
        {
          "author_name": "Josh Thompson",
          "author_url": "https://www.google.com/maps/contrib/100090626055211233282/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-oZ9TZnWhWxo/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjV0Tcf_8LCX-htnPgiblyKEpjAgng/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "I haven’t had fried chicken this good since my mother in law stopped making it.  Perfectly fried with a very savory crust.  The biscuit with the pepper jelly was a great accompaniment.\n\nThe bar is stocked with the largest whiskey selection I’ve experienced.  Large selection of craft cocktails, and beers if you drinking whiskey is not your thing.  Excellent service to top everything off.",
          "time": 1516142481
        },
        {
          "author_name": "Richard. Leach",
          "author_url": "https://www.google.com/maps/contrib/114006674075169786013/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-7rOWDZ6Kjlc/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjV8C7izfFX3KYOyk3ZcCicN74pisQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "If you are a student of fine rare whiskies and love expertly crafted cocktails, be prepared to being a kid in a grand candy store. Bartender, Brian, was both approachable and scholarly  but its the opportunity to try those bourbons you've only read about that is the star of the show.  I went for a late 2PM \"lunch\" on a Friday afternoon  (the ample meat/cheese spread was perfect) and I had the staff and bar practically to myself.",
          "time": 1518356975
        },
        {
          "author_name": "Ted P",
          "author_url": "https://www.google.com/maps/contrib/101839775385821436464/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-9f5hJAWQSP8/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjUQ-Ovc4_OFgjYwQaYZN2agdCVTTA/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "A mesmerizing collection of whiskies, from bourbons to American single malts and much more, this place can provide you with the very right kind of poison you prefer. The staff was curious and helpful, had a nice vibe to the place, the crowd was diverse and friendly as well. We didn't get to try the food but it all smelled really good, also seemed hygienic. It's is a must visit if you're visiting San Francisco area and especially if you're a whiskey maniac like me :)",
          "time": 1518384836
        }
      ],
