      "reviews": [
        {
          "author_name": "Michelle Stastny",
          "author_url": "https://www.google.com/maps/contrib/114390499094872348914/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-RGE5Y7tCaNk/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjV_AycnbtmaBJjmbSqK4YvtukeDzQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "We were in the city for a concert and dropped by here to eat dinner beforehand and we loved it. An older resturant with lots of character. The line was short & quick, the selection was good, pricing was reasonable and the food tasted great. (It's an order at the counter and take your meal to your table kind of place). The staff was friendly and the waitress was very attentive once we sat down with our plates to order our drinks and she was very informative about the beer selection (which there was a lot to choose from). I ordered the corned beef and cabbage with potatoes and it was so delicious and my husband ordered the pastrami dinner with mashed potatoes with gravy and he also enjoyed his meal. We were overall very happy with our experience. We loved the ambiance...  it's a fun place and we will definitely be back again. Only thing to remember is if you go there... have cash because it's a cash-only restaurant but if you do forget, they do have a ATM :-)",
          "time": 1516944668
        },
        {
          "author_name": "Edward Fong",
          "author_url": "https://www.google.com/maps/contrib/113939989489879868657/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-bzq_BfiFva0/AAAAAAAAAAI/AAAAAAAAABA/wBzvDoNq75k/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "Old San Francisco at its best.  All pastrami, corned beef, Turkey, roast beef, ham, chicken made daily on premise.  Recipes not change from 50 years ago.  Sandwich meats are hand carved and large portions for sandwiches and dinner plates.  Reasonably priced (lowest in expensive San Francisco).  Alcohol is also lowest priced in high priced area of San Francisco.  Decor has not changed in 50 years.  Nothing fancy.  Not for your tourist or executive lunch or dinner crowd.",
          "time": 1518447399
        },
        {
          "author_name": "Vanessa I",
          "author_url": "https://www.google.com/maps/contrib/102773650117585757302/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-miC0CMyAau8/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjX-qE_ipx48Q3jGtyPytEj8OJc_RQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 4,
          "relative_time_description": "2 months ago",
          "text": "Line was long, we were caught in the lunch time rush. Always good to see a place busy with customers. Took about 20 minutes to reach the front and order. What it lacks in presentation it makes up for in taste. The side sauce got the beef brisket sandwich was tangy and delicious! Note, cash only. Table service for drinks.",
          "time": 1513897054
        },
        {
          "author_name": "Cherokee Jimenez",
          "author_url": "https://www.google.com/maps/contrib/106570339547338298039/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-bbUOPauA3tc/AAAAAAAAAAI/AAAAAAAAOFc/RvUS-iB_sV4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "This place was sooooo good! The pastrami was cooked to perfection. Simple meals with big flavor. This is a great place to kick back enjoy some down time with friends, family or other. There is a bar that you can sit at or tables and booths. Nice low key atmosphere. I definitely will be back! PS...the pickles are all you can eat.",
          "time": 1513139936
        },
        {
          "author_name": "Susan Tamsky",
          "author_url": "https://www.google.com/maps/contrib/117547220096931190404/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-oKBy689ar8M/AAAAAAAAAAI/AAAAAAAAAOc/gbIM7QHa5Dg/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 1,
          "relative_time_description": "a month ago",
          "text": "Dirty and truly unsanitary. Crumbling walls and accessories, way beyond trying to emulate antiques. Posters and other art elements are taped or glued on so poorly that it is worse than a frat house. Artwork with face of person is a hole instead. The low ceiling in dining area that is beneath the second story bathrooms show that a leak had happened from that source. Not really repaired decently or stained to match. No pride of ownership in decor or food quality. Roast beef was ok, but the canned-like green beans were so peppery that there inedible and had no taste of the vegetable. Chili was so overcooked that the beans were mush. Don't bother coming.",
          "time": 1514876220
        }
      ],
