      "reviews": [
        {
          "author_name": "Miranda Triay",
          "author_url": "https://www.google.com/maps/contrib/112019433316303493882/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-uzMBeo9LXDA/AAAAAAAAAAI/AAAAAAAAAr0/XwCbP3PZrLI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "An exceptional German restaurant! Meat is well seasoned and have a great texture. The ravioli was especially flavorful - a perfect blend of meaty and creamy. The bread dumplings were great as well. The portions were hearty as well, so you don't have to worry about leaving unfulfilled!",
          "time": 1518304616
        },
        {
          "author_name": "Kimberly Ann Graham",
          "author_url": "https://www.google.com/maps/contrib/111401897967097745156/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-dOo8kSUaa9c/AAAAAAAAAAI/AAAAAAABy2A/wP_56bg7oJ4/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg",
          "rating": 3,
          "relative_time_description": "3 weeks ago",
          "text": "Food was just okay which would be fine if not for a couple of off-putting things.  The noise level is high and so are the prices.  I don't mind paying those prices for something worth it but I don't think what I had was that high end a meal. Attentive staff, no complaints.  The pretzel on the appetizer list was really good.",
          "time": 1516954855
        },
        {
          "author_name": "Aleksandr T",
          "author_url": "https://www.google.com/maps/contrib/111156926075252286026/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-jaa2sx3dXns/AAAAAAAAAAI/AAAAAAAAAEw/2EO8ncyL_90/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "One of the best places in town to get a good German beer. $8 per liter. \n\nFood is great. Lively place that gets pretty loud but it's all part of the experience.",
          "time": 1518935064
        },
        {
          "author_name": "Jennifer J",
          "author_url": "https://www.google.com/maps/contrib/116680361161022047831/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-zHmheichyQ8/AAAAAAAAAAI/AAAAAAAADDA/bP08Rt42zFU/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "4 months ago",
          "text": "Solid German food. consistent over the last 10 years? I've been going here. Great German beer selection, and a substantial brunch. It's no nonsense eating here. Tables are communal, and casual is the vibe.",
          "time": 1507910964
        },
        {
          "author_name": "Sarah Miller",
          "author_url": "https://www.google.com/maps/contrib/105017941737232423025/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-ryu-xF_VY6M/AAAAAAAAAAI/AAAAAAAAAAA/bLKy67IZVB0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "So so good! Bring a big appetite - great ambience too! Fun",
          "time": 1519240159
        }
      ],
