      "reviews": [
        {
          "author_name": "Nathan Riehl",
          "author_url": "https://www.google.com/maps/contrib/101020145805020043985/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-qX_5DHl-INM/AAAAAAAAAAI/AAAAAAAAADk/FdibeHayGYM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "Bix was great!! We loved the vibe the moment we walked in (it turned out it was originally a bank back when it was first built). We had a wonderful custom cocktail be for our party arrived and enjoyed the live piano playing right behind us. At our table we had a fun painting behind us, in fact they had a ton of great artwork!\nThe food was AMAZING. I had the duck and it basically melted in my mouth. The vegetables were some of the best I've ever had and it was presented perfectly.\nOverall it was one of the best dinning experiences I've had San Francisco!",
          "time": 1517448601
        },
        {
          "author_name": "Leighton",
          "author_url": "https://www.google.com/maps/contrib/116888296688993008525/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-9uc_sPepelA/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjVM6Sw5jeqRLJz5weyBmGgAWiDTpA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "in the last week",
          "text": "Very nice atmosphere and really great food. The staff was professional and knowledgeable. The place has a somber quiet mood in the dining area which check is perfect for a date night. Downstairs there is more of a lounge atmosphere. Best poached eggs I have ever had.",
          "time": 1518859670
        },
        {
          "author_name": "Randy Sisk",
          "author_url": "https://www.google.com/maps/contrib/105376781297712445391/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-j2OkqpfuuD4/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjU6w0nllQbZpzUkN5n9-PRla69-7Q/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "Upscale and classy. Steak tartar was incredible. Drinks are great. Dessert was first rate. Great service.",
          "time": 1518607928
        },
        {
          "author_name": "Sofia Jukelson",
          "author_url": "https://www.google.com/maps/contrib/110061198966525296306/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-DxPQfnvm3qc/AAAAAAAAAAI/AAAAAAAASNs/Nrs9KNaUmHI/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "4 months ago",
          "text": "Loved the place! With a strong 30's ambiance this place is wonderful for a good dinner with your colleagues as well as friends. The menu offers all time European-American classics and delicious deserts (must have) that you can enjoy with live music. Will definitely go back!",
          "time": 1508249658
        },
        {
          "author_name": "Pam Hawk",
          "author_url": "https://www.google.com/maps/contrib/105788435894835191954/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-ZmkwQEVx8oE/AAAAAAAAAAI/AAAAAAAAdV8/z6LgbsO0m9M/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "Great old school Jazz Supper Bar. Can be loud and crowded when offices let out. Excellent cocktails. Bartenders and staff in penguin suits like in times long past. Live jazz nightly. Great food. Some of the best steak tartare in town made tableside  It's a good old standby for a good times with friends after work or even for a special occasion. Make reservations for dinner. I've come since they opened and have never been disappointed.",
          "time": 1514230328
        }
      ],
