          "rating": 5,
          "relative_time_description": "a year ago",
          "text": "Simply special! Always can expect the great service from the Ritz and the prix menu was excellent wth flavors and selections that please. The chefs selection provides market fresh choices and when paired with wine a most tantalizing invigorating experience! Cost is worth the presentation and work that goes into the food.",
