          "rating": 4,
          "relative_time_description": "3 months ago",
          "text": "Seasonal pecan tea cookie is crispy, delicious and sweet, but can get messy with all the powdered sugar. Oatmeal raisin cookie was dry and hard on a weekday afternoon in case you like them soft and chewy like me. Outdoor seating available next door in front of Philz Coffee.",
