          "text": "COOKIES.....\n\nYeah I pretty much go to Specialty's for one thing.. and that is their cookies. THEY ARE SO DARN GOOD. $3 dollars per cookie is a little steep but they are worth it. I love love all their cookies especially the chocolate chip walnut cookie! This location is particularly convenient since they have a window where you can purchase the baked goods :D",
