      "reference": "CmRRAAAAuYKb2AoQY2s809lBlCYv2SPjGzUVdeTnO_EVx_dcGblHDQL8uXG18eO0IwW5g7nDugJ2LiEqqRykG21yuoUuwbiccGcDlWtk8nc3oiupNw8u9vzFYQxqOnVV6p_vAL87EhCNWqXsN4XgpilgqHXYcVLQGhRzgwYQfnxXNeZ72GgBZZNxH1QSfw",
      "reviews": [
        {
          "author_name": "Marc F",
          "author_url": "https://www.google.com/maps/contrib/112111657174574757933/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-RpPWLYu4zrc/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXxKyS2LunWu_TNaCLDrtYvi_tYug/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "It was late, I had missed dinner, I was in the neighborhood. I eat a lot of Japanese food as comfort food - Ryoko's knows what they're doing with the traditional items and isn't afraid of putting a twist on some others. Fast, friendly, upbeat vibe. You won't waste your time here.",
          "time": 1519029714
        },
        {
          "author_name": "Yingjia Lee",
          "author_url": "https://www.google.com/maps/contrib/107783386935819122346/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-_tyz32fLIZQ/AAAAAAAAAAI/AAAAAAAAA1c/N6irxlg5MJY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 weeks ago",
          "text": "Food was decent, but the liveliness makes it a five star. The food is relatively good for it's price, but don't come here if you're looking for a fancy Japanese meal. It's more of an izakaya vibe with small dishes and rolls and alcohol. Would definitely come back for a chill night to just drink and chat with friends.",
          "time": 1517858660
        },
        {
          "author_name": "Dustin L",
          "author_url": "https://www.google.com/maps/contrib/104704569051340273293/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-rz40Cyxm5gM/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjWVcvsWgzTPSwl-KSco3-mogpcHmA/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "So fun! Friend recommended this place and it didn't disappoint. Food was really solid and the staff were great. Energy in the place was exceptionally high from the moment I walked in to the moment I left. I'll be back for sure. \nRemoved one star as the bathrooms are really sketchy. Highly recommend an upgrade.",
          "time": 1518145509
        },
        {
          "author_name": "Paul Hung",
          "author_url": "https://www.google.com/maps/contrib/112934517020451769044/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-GT6luAJPJmI/AAAAAAAAAAI/AAAAAAAAFgw/epBGxoQOzb0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "Decor: 3/5\n-Loud yelling, which I understand is the culture however it was a bit too much while trying to enjoy dinner\n\nService: 4/5\n-sign the clipboard for the waiting this as Ryoko's fills up fast\n-the food comes as it is prepared though it didn't take terribly long to get our food\n-you can split checks into multiple credit cards\n\nFood: 4/5\n-Fried baby octopus was my absolute favorite. The flavor was just mouth-watering addicting. I would highly recommend ordering two. Solid 5 out of 5.\n-Whole soft shell crab needs some work. If they used the same batter as the fried octopus for the soft shell crab, that would be a winner. 2 out of 5.\n-Alcatraz (bbq eel with avocado) and Sexy (crab with salmon and melted cheese) were both on point and a solid 4 out of 5.",
          "time": 1515976894
        },
        {
          "author_name": "John James",
          "author_url": "https://www.google.com/maps/contrib/105778211253472713280/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-TyALt8h7yJo/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjXE1iwI9NLWmITYf8KJfAu-V7WCfg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "Only very rarely do you find a place where the food is as good as the atmosphere. Ryoko's will provide both so it's no surprise that there's always a line of eager foodies blocking the entrance. Inside the air is thick with electro beats, vivacious chatter and laughter. Beer and sake flow freely together with the good times you'll experience during your dinner. \n\nNot for the people hard of hearing or those expecting a quiet intimate dinner. You come here to eat, drink and share.",
          "time": 1512327672
        }
      ],
