      "reviews": [
        {
          "author_name": "Henry Levin",
          "author_url": "https://www.google.com/maps/contrib/100566898505810038017/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-v0YSgkUEXXM/AAAAAAAAAAI/AAAAAAAAAd8/0TMiW_UROmE/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "I really enjoy the food here. Had several different dishes here in the past and was always impressed with both quality and presentation. I have only visited this place for lunch so can't speak for dinner or any other times. \n\nSraff is very pleasant always. They attended to us just the right number of times and addressed all questions and requests.\n\nI was torn between 4 and 5 stars because of 2 reasons: the prices are on the higher end but I guess location has a lot to do with it and the second - the place is too loud to have a business lunch meeting. I still settled on 5 stars as I believe it is of no fault of the restaurant and cannot be easily addressed.\n\nI highly recommend this place for casual lunch with friends or coworkers.",
          "time": 1517170525
        },
        {
          "author_name": "Simon Johnstone",
          "author_url": "https://www.google.com/maps/contrib/111204062219612588213/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-eFLWUR4Ylcs/AAAAAAAAAAI/AAAAAAAABzI/Q-4c5hogF_s/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "in the last week",
          "text": "Pretty standard Thai restaurant fare, well presented in a slightly-trendy-but-not-pretentious setting. Osha is one of my top choices when I'm in the area and just want a reliably good meal in a chilled out environment. Staff are pleasant, service is relaxed but not overly slow.",
          "time": 1518865641
        },
        {
          "author_name": "S. Regena Ross",
          "author_url": "https://www.google.com/maps/contrib/110527173092782031078/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-KCjukPCQpUw/AAAAAAAAAAI/AAAAAAAAAe4/wYCOQC9Mr7w/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "I enjoyed my Pad Thai noodles but I've had better.  The noodles stuck together and were in a lump.  I forgot to take a picture of the dish.  The service was fine.  It was quite busy on a Friday night on a holiday weekend.  There is a lounge but it is only open Mon-Friday.  There is a bar here.  Unfortunately, the space is small so it felt like it there was too much furniture along with the bar.",
          "time": 1515969486
        },
        {
          "author_name": "Kyle White",
          "author_url": "https://www.google.com/maps/contrib/100075841280804377681/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-5w9eTPmDcz4/AAAAAAAAAAI/AAAAAAAABXU/CgGiKKAlzHE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "Fun atmosphere, classic dishes with a few twists. We had the shrimp spring rolls, wontons, and pumpkin chicken curry. The rice noodle around the rolls was great, the wontons hit the spot with the sweet/spicy sauce. Th pumpkin curry had just the right amount of kick. Service was a little sparse and prices were just a little too high, but you pay a little for the atmosphere I guess. Would give a 3.5 if I could. Solid Thai place that is fun if you want to mix it up a bit.",
          "time": 1518321281
        },
        {
          "author_name": "Soubhik Dawn",
          "author_url": "https://www.google.com/maps/contrib/116169182974525349442/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-pSo1F7ERQ4c/AAAAAAAAAAI/AAAAAAAAlqI/CeYRCA0UucA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "2 weeks ago",
          "text": "Good food but service during peak lunch hours isn't great. Be prepared for waiting forever for your food.\nIf you're selecting this venue for dinner, be careful about the closing time. Google maps says that it closes at 9:30 while this place actually closes at 9.",
          "time": 1517737459
        }
      ],
