      "reviews": [
        {
          "author_name": "Jennifer Lo",
          "author_url": "https://www.google.com/maps/contrib/107596985540899686706/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-C4PJF2dfEhc/AAAAAAAAAAI/AAAAAAAAS-w/-k3EhsnV0fk/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 3,
          "relative_time_description": "3 months ago",
          "text": "First location of Mission Chinese! I headed here for a late dinner around 10pm and still had to wait a good 20 minutes or so. It's located in the Mission in a bit of a dodgy area but close enough to the BART so it's not that bad. After getting a table, we ordered the salt cod fried rice and the lamb noodles. The noodles were pretty good- spicy and flavorful. But our salt cod fries rice never came. I had to remind the waitress after a half hour wait. The service overall was very poor as it was hard to get the waiters' attention. Also, you have to step through the kitchen to get to the bathroom which definitely turned me off as I got a view of the cleanliness. It irked me a bit and made me question the sanitary level. Overall food was good but I don't think it was any outstanding Chinese food.",
          "time": 1511150268
        },
        {
          "author_name": "Mikee Sevilla",
          "author_url": "https://www.google.com/maps/contrib/118067109521182210214/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-m_ls_84fDVo/AAAAAAAAAAI/AAAAAAAABA4/yCsW25y-4TU/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 1,
          "relative_time_description": "in the last week",
          "text": "This place looked like a tiny stripclub. It was dark and only had red lights on so it was difficult to see the food you were served and it's quality. I ordered the Mapo Tofu because it's reviews were good. It was like old ground pork swimming in oil! It's literally soup made of just oil. There's a few cubes of tofu and they put a handful of chili peppers in it. I told the server couldn't eat it, so I paid for this overpriced garbage and left. Horrible.",
          "time": 1519168865
        },
        {
          "author_name": "Charlie Mai",
          "author_url": "https://www.google.com/maps/contrib/102583760806558600103/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-IoJK1SzrCrw/AAAAAAAAAAI/AAAAAAAAAAo/vqTzJokWbE8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "This ain’t your ordinary Chinese-inspired joint. You’ll first learn of this when you walk in and see the giant dragon sprawled across the ceiling over the entire length of the restaurant, or the cut-out of Michael Jordan in the back corner across from the kitchen. \n\nTo navigate to Mission Chinese, look for the sign under Lung Shan Restaurant. If you make it that far, you’re in for some tasty bites. I especially recommend the Thrice Cooked Bacon and Rice Cakes - it’s savory, it’s got a little kick and the rice cakes are just pillows of chewy deliciousness that ties it all together. \n\nWhen in SF, this should be a stop.",
          "time": 1513112762
        },
        {
          "author_name": "Neil Bardhan",
          "author_url": "https://www.google.com/maps/contrib/106416652642040316461/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-VfJCtwm_17I/AAAAAAAAAAI/AAAAAAAAAGs/gL76OuRqneI/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "The food and decor here are great. The staff is very courteous and helpful. Would love to visit again. Recommend the fiery dumplings.",
          "time": 1514398942
        },
        {
          "author_name": "Revant Kapoor",
          "author_url": "https://www.google.com/maps/contrib/112371186739671097462/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-GuRZNcpR1YY/AAAAAAAAAAI/AAAAAAABKZw/7hErcCjw_oo/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a week ago",
          "text": "Great Chinese fusion. The sour chilli chicken was delicious and the macha noodles were pretty good too. The service is okay, but at least it's fast.",
          "time": 1518161460
        }
      ],
