      "reference": "CmRRAAAAs2FDi_8lVv1umosspI6z7V1VYt4jC-HQDJEk72HiBAQitaAswjTpv2CMBM_iEHKggc0vf69_BZZhBR-gJJyMlPxRHD9VRcvcPeq1_vxuDvRvpKO4DPLvkegABWAhUoUlEhCO6wEPsF0ZBX053lxPwZSfGhRRQObTo2sqG53iN1l6lpeAojdmHg",
      "reviews": [
        {
          "author_name": "Knakyta Joseph",
          "author_url": "https://www.google.com/maps/contrib/108254582120828715616/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-ulRRyrKUuPw/AAAAAAAAAAI/AAAAAAAAHW8/Jeb_SD-BlUg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "Love the environment. Great steak the way I like mine medium well done. Wine choice was new for me . I never have red before but will be coming back again for a me day and treat.  Great bread and butter they bring to the table. Waiter was pleasant and very informational about the wines as well as food. Great pick for a girls get together or family night out.",
          "time": 1513667292
        },
        {
          "author_name": "Micaiah Filkins",
          "author_url": "https://www.google.com/maps/contrib/101532587820792498485/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-I5FnnL6Z5ls/AAAAAAAAAAI/AAAAAAAALS8/DTmAwnaA6fQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 3,
          "relative_time_description": "2 months ago",
          "text": "The Japanese beef game here is second to none in SF.  The truffle mac and cheese is amazing.  This spot used to be one of my favorite steakhouses.  Was there last week.  The service is mediocre, but not bad.  The cocktail program is okay to good. The US steaks are good.",
          "time": 1514067618
        },
        {
          "author_name": "Jason Hertz",
          "author_url": "https://www.google.com/maps/contrib/108047339240114909154/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-uz_3jQANDiI/AAAAAAAAAAI/AAAAAAAAAEU/Jc_EasUb2xY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 4,
          "relative_time_description": "a month ago",
          "text": "My steak was really good. The sides were just okay. Our server was nice but not exactly the kind of server I prefer. His personality was sort of blah but it wasn't like he was a jerk and he did a decent job serving us. The restaurant itself is a little too bright. This is supposed to be at trendy Steak House and although they had some music playing in the background it was lit up more like a Outback Cafe. As far as the food was concerned my steak was excellent. I had a 32 ounce ribeye and it was cooked perfectly. I would probably go back there but I would want to try other places and look for something better before doing so",
          "time": 1514741581
        },
        {
          "author_name": "Jung Kim",
          "author_url": "https://www.google.com/maps/contrib/117257794115423280661/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-l_eTrPKkjcg/AAAAAAAAAAI/AAAAAAAAERU/pJ0x2Qg7LXQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "love the setting and love the way they present food.  on the pricier side but is well worth given the experience.  the service we received was nothing short of excellent.",
          "time": 1516909865
        },
        {
          "author_name": "John Cruz",
          "author_url": "https://www.google.com/maps/contrib/105201439340548074645/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-PYvbBzWCb5U/AAAAAAAAAAI/AAAAAAAAAWM/B6_OOaPU2mY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "A bit spend, but delicious. Food was high quality and well prepared. Flavor profiles were excellent.",
          "time": 1516009994
        }
      ],
