      "reviews": [
        {
          "author_name": "Wilson Hardcastle",
          "author_url": "https://www.google.com/maps/contrib/110402685858198351752/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-ydPf4zSoECU/AAAAAAAAAAI/AAAAAAAAAAA/f2627RaQiRQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 1,
          "relative_time_description": "in the last week",
          "text": "Bisou used to be a beautiful, nice French dining experience. Perfect for dates. We went for Sunday brunch recently. Our ears bled from the aggressively loud DJ. The music is good but would be too loud at half the volume. Conversation was not possible.  Even the waiter could not hear us. They got our order wrong. Then our food arrived cold. And incomplete. We asked for corrections but they didn’t arrive until after we were finished. \n\nSadly it’s now devolved into a pretty trashy basic scene. Maybe it’s the bottomless mimosas. People come for the cheap day drunk. If that’s your crowd.",
          "time": 1518987173
        },
        {
          "author_name": "James Burger",
          "author_url": "https://www.google.com/maps/contrib/105905382424503256991/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-JocrXIjq--A/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjUZf_dBi3Kq0HevIif1rybei_WdFw/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 3,
          "relative_time_description": "a week ago",
          "text": "I've visited twice. First time, four stars. Would've been five, but one of the dishes was a miss (I had the foie gras tasting menu). Was nice and quiet and excellent service.\nSecond time, three stars...was cut in line (by someone who was with no one and had no one else in his party), and the host served that person ahead of me. Very rude, on both parts. Additionally, they only have one single occupancy bathroom operating for Sunday brunch, and it isn't kept the cleanest. The server was still excellent and the food was fine.",
          "time": 1518489841
        },
        {
          "author_name": "Megan E",
          "author_url": "https://www.google.com/maps/contrib/102312248194238735442/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-O3x1TpV6y58/AAAAAAAAAAI/AAAAAAAAUVY/8AXSfDrlqK4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Cute spot with bottomless mimosa option for only $15. They also have a wide selection of different benedict breakfasts which almost everyone at my table got: crab cake, scallop, and duck leg. The scallop was my favorite, the scallops were perfectly cooked. I prefer a more lemony hollandaise, but it was still delicious. They also provide you with more than enough mimosas, they definitely do not skimp.",
          "time": 1516663449
        },
        {
          "author_name": "ben kurley",
          "author_url": "https://www.google.com/maps/contrib/101871797504080862145/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-m0Zrz4ugaQo/AAAAAAAAAAI/AAAAAAAAAAA/ACSILjWifB4prHG52IbCtmqhuCsmgHCHTw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 months ago",
          "text": "Chef Nick has been apart of my culinary adventures since I migrated here 6 years ago. Delicious and well thought out menu with a wide selection of wine and liquor. I always have a fabulous time when I grace Bisou Bistronomy with my presence.",
          "time": 1510959212
        },
        {
          "author_name": "Yara",
          "author_url": "https://www.google.com/maps/contrib/100817081259773449889/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-4d7HuG1kVGw/AAAAAAAAAAI/AAAAAAAAASM/pnFjuoqxtnM/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 months ago",
          "text": "Small French restaurant with a lovely decor. Perfect location on Market Street, next to Castro. Friendly and welcoming staff. The food is delicious, especially the seared scallops. Good wine list too.",
          "time": 1510160831
        }
      ],
