      "rating": 4.2,
      "reference": "CmRSAAAA7cwpRD242r745BEt6ZazGg4tETXblylrWQnzvJlT3o-4Y75gPOXR2Cic2QTwmRvjlt8ofFhpRIur0Ky9372-9kX_uJ0rQ9T3JIbgcAeaVOfdMM68AeoTdeT0GtKvXhc4EhDQpmkDYzbRXuFwR17YPct0GhTsg9Nr5WwJk2riITrxDUfDAycKBw",
      "reviews": [
        {
          "author_name": "Aaron Bryson",
          "author_url": "https://www.google.com/maps/contrib/107688385324440994519/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-jG_EG-C2_Ac/AAAAAAAAAAI/AAAAAAAADEQ/4ndMb3sGpAY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "in the last week",
          "text": "Hands down the best calamari that I have ever eaten.\n\nMy dining companion had the BBQ burger and fount it equally superlative​. The ambiance of a restaurant that has been around for 80+ years really does have a ​special charm. This is one to not miss. Excellent in every way. The service was superb and the restaurant had a great vibe and feel to it. It's easy to see why they have been in business for 80+ years. Great for lunch. Only regret was that I didn't get to go back a second time.",
          "time": 1518748208
        },
        {
          "author_name": "Mia Pacey",
          "author_url": "https://www.google.com/maps/contrib/110653105518331517999/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-J_gXmdoUpVI/AAAAAAAAAAI/AAAAAAAADkA/BKb_LENkD-c/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Awesome! This place has blown up in popularity in the last year. We love their pancakes with fruit and bacon. The fresh orange juice is a nice addition. I would recommend this place for breakfast to anyone in town. You do see a lot of tourists here and there is sometimes a line out the door but this moves quickly. Will definitely be back.",
          "time": 1514611224
        },
        {
          "author_name": "LD H",
          "author_url": "https://www.google.com/maps/contrib/117776307975720538105/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-GvcMbGfH_fQ/AAAAAAAAAAI/AAAAAAAAGVo/NVvyFkuxfKE/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 4,
          "relative_time_description": "2 weeks ago",
          "text": "Good place for breakfast.  Pancakes are popular, however we had Omelets and home made hash, which really hit the spot!  \nIt is bustling and noisy, with lots of conversation.  If you're looking for a quieter spot, you may want to go somewhere else.  Otherwise, worth the visit.",
          "time": 1517574108
        },
        {
          "author_name": "Steven Lo",
          "author_url": "https://www.google.com/maps/contrib/101966405393897234206/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-eaBUQbnz7cY/AAAAAAAAAAI/AAAAAAAABxw/NXVN3RhS1Qs/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "2 months ago",
          "text": "Got a great dinner with my friend. All dishes were beautifully cooked and tasted so good. The portion was generous. Pork chop were tender and juicy. Service were awesome too. Wanna try its breakfast as well.",
          "time": 1513099243
        },
        {
          "author_name": "Heather Clark",
          "author_url": "https://www.google.com/maps/contrib/115262848591251564355/reviews",
          "language": "en",
          "profile_photo_url": "https://lh5.googleusercontent.com/-011oMUeZOCc/AAAAAAAAAAI/AAAAAAAADGU/wHaESE19IaU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "Ate breakfast here with family. There was a line out the door but was able to get seats for four at the counter. This allowed us to chat with others visiting San Francisco. The \"world famous\" Swedish pancakes were yummy as was the veggie omlette. Oh and the Bellini was tasty too!",
          "time": 1515169269
        }
      ],
