        {
          "author_name": "Raquel B",
          "author_url": "https://www.google.com/maps/contrib/105191897253249906351/reviews",
          "language": "en",
          "profile_photo_url": "https://lh6.googleusercontent.com/-K7tb75ZQx_Y/AAAAAAAAAAI/AAAAAAAAHD4/h7iWowyLOg0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 4,
          "relative_time_description": "a week ago",
          "text": "The steaks are delicious and big portions. Be sure to order a side to go with the meat. The decorations and seating are dated/underwhelming, but the food will make up for it. This is a great steak house that is often skipped due to appearance. (Hardly any options for vegetarians)",
          "time": 1518652247
        },
        {
          "author_name": "Michael Wojtowicz",
          "author_url": "https://www.google.com/maps/contrib/112585593541954756683/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-GGKpS7x6xSk/AAAAAAAAAAI/AAAAAAAABlQ/fP6j8Crm-ZE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
          "rating": 3,
          "relative_time_description": "in the last week",
          "text": "Good food but not consummate with the prices. You would imagine they would now how to season food to get more flavor. It wasn't bland but not full of flavor from the deglazing they do for the sauce served with the steak. Dreadful coffee and not a non diary options for creamer. The service was average. The worst part was the patrons, which is no fault of the establishment.",
          "time": 1518935889
        },
        {
          "author_name": "Maria Romero",
          "author_url": "https://www.google.com/maps/contrib/113213999325851064052/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-jHSwmzKGUxM/AAAAAAAAAAI/AAAAAAAAAAs/12ahS3Nkfk4/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "a month ago",
          "text": "One of the very best steak houses in S.F. Ambiance is very fun and eclectic. Staff is always friendly. Never have had a bad meal at Bobo's!",
          "time": 1516061459
        },
        {
          "author_name": "Alex Gosselin",
          "author_url": "https://www.google.com/maps/contrib/108466122468044889326/reviews",
          "language": "en",
          "profile_photo_url": "https://lh4.googleusercontent.com/-a9KiuDPNt2Y/AAAAAAAAAAI/AAAAAAAAADU/81x3Z-BoLYc/s128-c0x00000000-cc-rp-mo/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "Walked here on accident because the house of Prime Rib had a 2 hour wait. We sat down at the bar with no wait.\nNever had a Bone in Filet before. Nice crust and a perfect medium rare. Melted in your mouth. Bobo's a steak propro!! Looking forward to coming here again.👍👍",
          "time": 1517439745
        },
        {
          "author_name": "Dan Trujillo",
          "author_url": "https://www.google.com/maps/contrib/109567905611111048920/reviews",
          "language": "en",
          "profile_photo_url": "https://lh3.googleusercontent.com/-2aDolguf520/AAAAAAAAAAI/AAAAAAAACEI/bBTlLsrSkPA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
          "rating": 5,
          "relative_time_description": "3 weeks ago",
          "text": "Fabulous! We came for a birthday celebration, sat in the upstairs room filled with red velour and low lit Venetian décor, steaks were phenomenal - bone-in ribeye and the New York New York (Sinatra style) - with Brussels sprouts and the double baked potato sides.  Staff and service was great!  Look forward to my next visit.",
          "time": 1517114207
        }
